INSERT INTO `haozhi_brand_norm` VALUES (1, '<p><span>一、申请商标注册，应当按照公布的商品和服务分类表填报。每一件商标注册申请应当向商标局提交《商标注册申请书》1份、商标图样1份；以颜色组合或者着色图样申请商标注册的，应当提交着色图样，并提交黑白稿1份；不指定颜色的，应当提交黑白图样。</span><br><span>商标图样应当清晰，便于粘贴，用光洁耐用的纸张印制或者用照片代替，长和宽应当不大于10厘米，不小于5厘米。</span><br><span>以三维标志申请商标注册的，应当在申请书中予以声明，说明商标的使用方式，并提交能够确定三维形状的图样，提交的商标图样应当至少包含三面视图。</span><br><span>以颜色组合申请商标注册的，应当在申请书中予以声明，说明商标的使用方式。</span><br><span>以声音标志申请商标注册的，应当在申请书中予以声明，提交符合要求的声音样本，对申请注册的声音商标进行描述，说明商标的使用方式。对声音商标进行描述，应当以五线谱或者简谱对申请用作商标的声音加以描述并附加文字说明；无法以五线谱或者简谱描述的，应当以文字加以描述；商标描述与声音样本应当一致。</span><br><span>申请注册集体商标、证明商标的，应当在申请书中予以声明，并提交主体资格证明文件和使用管理规则。</span><br><span>商标为外文或者包含外文的，应当说明含义。</span><br><span>二、申请商标注册的，申请人应当提交其身份证明文件。商标注册申请人的名义与所提交的证明文件应当一致。</span><br></p><p><span>前款关于申请人提交其身份证明文件的规定适用于向商标局提出的办理变更、转让、续展、异议、撤销等其他商标事宜。</span></p><p><b>三、</b>商品或者服务项目名称应当按照商品和服务分类表中的类别号、名称填写；商品或者服务项目名称未列入商品和服务分类表的，应当附送对该商品或者服务的说明。</p><span>商标注册申请等有关文件以纸质方式提出的，应当打字或者印刷。</span><br><span>本条第二款规定适用于办理其他商标事宜。</span><br><span>四、共同申请注册同一商标或者办理其他共有商标事宜的，应当在申请书中指定一个代表人；没有指定代表人的，以申请书中顺序排列的第一人为代表人。</span><br><span>商标局和商标评审委员会的文件应当送达代表人。</span><br><span>五、申请人变更其名义、地址、代理人、文件接收人或者删减指定的商品的，应当向商标局办理变更手续。</span><br><p><span>申请人转让其商标注册申请的，应当向商标局办理转让手续。</span></p><p><span>六、商标注册的申请日期以商标局收到申请文件的日期为准。</span></p><span>商标注册申请手续齐备、按照规定填写申请文件并缴纳费用的，商标局予以受理并书面通知申请人；申请手续不齐备、未按照规定填写申请文件或者未缴纳费用的，商标局不予受理，书面通知申请人并说明理由。申请手续基本齐备或者申请文件基本符合规定，但是需要补正的，商标局通知申请人予以补正，限其自收到通知之日起30日内，按照指定内容补正并交回商标局。在规定期限内补正并交回商标局的，保留申请日期；期满未补正的或者不按照要求进行补正的，商标局不予受理并书面通知申请人。</span><br><p><span>本条第二款关于受理条件的规定适用于办理其他商标事宜。</span></p><p><span>七、两个或者两个以上的申请人，在同一种商品或者类似商品上，分别以相同或者近似的商标在同一天申请注册的，各申请人应当自收到商标局通知之日起30日内提交其申请注册前在先使用该商标的证据。同日使用或者均未使用的，各申请人可以自收到商标局通知之日起30日内自行协商，并将书面协议报送商标局；不愿协商或者协商不成的，商标局通知各申请人以抽签的方式确定一个申请人，驳回其他人的注册申请。商标局已经通知但申请人未参加抽签的，视为放弃申请，商标局应当书面通知未参加抽签的申请人。</span></p><p><span>八、依照商标法第二十五条规定要求优先权的，申请人提交的第一次提出商标注册申请文件的副本应当经受理该申请的商标主管机关证明，并注明申请日期和申请号。</span></p><p>特别声明：本平台在确认合同过程中 ，如发现非正常申请的，将会退回案件、解除代理合同并退还已付费用，由此导致的申报问题平台不承担相关责任。</p><p></p>');
