INSERT INTO `haozhi_data` VALUES ('1571321847654', '规范商标申请注册行为若干规定（国家市场监督管理总局令第17号）', 'http://q55l2dpen.bkt.clouddn.com/d0a756b7e5264d9d8562128556877963', '<p align=\"justify\">　　第一条 为了规范商标申请注册行为，规制恶意商标申请，维护商标注册管理秩序，保护社会公共利益，根据《中华人民共和国商标法》（以下简称商标法）和《中华人民共和国商标法实施条例》（以下简称商标法实施条例），制定本规定。</p><p align=\"justify\">　　第二条 申请商标注册，应当遵守法律、行政法规和部门规章的规定，具有取得商标专用权的实际需要。</p><p align=\"justify\">　　第三条 申请商标注册应当遵循诚实信用原则。不得有下列行为：</p><p align=\"justify\">　　（一）属于商标法第四条规定的不以使用为目的恶意申请商标注册的；</p><p align=\"justify\">　　（二）属于商标法第十三条规定，复制、摹仿或者翻译他人驰名商标的；</p><p align=\"justify\">　　（三）属于商标法第十五条规定，代理人、代表人未经授权申请注册被代理人或者被代表人商标的；基于合同、业务往来关系或者其他关系明知他人在先使用的商标存在而申请注册该商标的；</p><p align=\"justify\">　　（四）属于商标法第三十二条规定，损害他人现有的在先权利或者以不正当手段抢先注册他人已经使用并有一定影响的商标的；</p><p align=\"justify\">　　（五）以欺骗或者其他不正当手段申请商标注册的；</p><p align=\"justify\">　　（六）其他违反诚实信用原则，违背公序良俗，或者有其他不良影响的。</p><p align=\"justify\">　　第四条 商标代理机构应当遵循诚实信用原则。知道或者应当知道委托人申请商标注册属于下列情形之一的，不得接受其委托：</p><p align=\"justify\">　　（一）属于商标法第四条规定的不以使用为目的恶意申请商标注册的；</p><p align=\"justify\">　　（二）属于商标法第十五条规定的；</p><p align=\"justify\">　　（三）属于商标法第三十二条规定的。</p><p align=\"justify\">　　商标代理机构除对其代理服务申请商标注册外，不得申请注册其他商标，不得以不正当手段扰乱商标代理市场秩序。</p><p align=\"justify\">　　第五条 对申请注册的商标，商标注册部门发现属于违反商标法第四条规定的不以使用为目的的恶意商标注册申请，应当依法驳回，不予公告。</p><p align=\"justify\">　　具体审查规程由商标注册部门根据商标法和商标法实施条例另行制定。</p><p align=\"justify\">　　第六条 对初步审定公告的商标，在公告期内，因违反本规定的理由被提出异议的，商标注册部门经审查认为异议理由成立，应当依法作出不予注册决定。</p><p align=\"justify\">　　对申请驳回复审和不予注册复审的商标，商标注册部门经审理认为属于违反本规定情形的，应当依法作出驳回或者不予注册的决定。</p><p align=\"justify\">　　第七条 对已注册的商标，因违反本规定的理由，在法定期限内被提出宣告注册商标无效申请的，商标注册部门经审理认为宣告无效理由成立，应当依法作出宣告注册商标无效的裁定。</p><p align=\"justify\">　　对已注册的商标，商标注册部门发现属于违反本规定情形的，应当依据商标法第四十四条规定，宣告该注册商标无效。</p><p align=\"justify\">　　第八条 商标注册部门在判断商标注册申请是否属于违反商标法第四条规定时，可以综合考虑以下因素：</p><p align=\"justify\">　　（一）申请人或者与其存在关联关系的自然人、法人、其他组织申请注册商标数量、指定使用的类别、商标交易情况等；</p><p align=\"justify\">　　（二）申请人所在行业、经营状况等；</p><p align=\"justify\">　　（三）申请人被已生效的行政决定或者裁定、司法判决认定曾从事商标恶意注册行为、侵犯他人注册商标专用权行为的情况；</p><p align=\"justify\">　　（四）申请注册的商标与他人有一定知名度的商标相同或者近似的情况；</p><p align=\"justify\">　　（五）申请注册的商标与知名人物姓名、企业字号、企业名称简称或者其他商业标识等相同或者近似的情况；</p><p align=\"justify\">　　（六）商标注册部门认为应当考虑的其他因素。</p><p align=\"justify\">　　第九条 商标转让情况不影响商标注册部门对违反本规定第三条情形的认定。</p><p align=\"justify\">　　第十条 注册商标没有正当理由连续三年不使用的，任何单位或者个人可以向商标注册部门申请撤销该注册商标。商标注册部门受理后应当通知商标注册人，限其自收到通知之日起两个月内提交该商标在撤销申请提出前使用的证据材料或者说明不使用的正当理由；期满未提供使用的证据材料或者证据材料无效并没有正当理由的，由商标注册部门撤销其注册商标。</p><p align=\"justify\">　　第十一条 商标注册部门作出本规定第五条、第六条、第七条所述决定或者裁定后，予以公布。</p><p align=\"justify\">　　第十二条 对违反本规定第三条恶意申请商标注册的申请人，依据商标法第六十八条第四款的规定，由申请人所在地或者违法行为发生地县级以上市场监督管理部门根据情节给予警告、罚款等行政处罚。有违法所得的，可以处违法所得三倍最高不超过三万元的罚款；没有违法所得的，可以处一万元以下的罚款。</p><p align=\"justify\">　　第十三条 对违反本规定第四条的商标代理机构，依据商标法第六十八条的规定，由行为人所在地或者违法行为发生地县级以上市场监督管理部门责令限期改正，给予警告，处一万元以上十万元以下的罚款；对直接负责的主管人员和其他直接责任人员给予警告，处五千元以上五万元以下的罚款；构成犯罪的，依法追究刑事责任。情节严重的，知识产权管理部门可以决定停止受理该商标代理机构办理商标代理业务，予以公告。</p><p align=\"justify\">　　第十四条 作出行政处罚决定的政府部门应当依法将处罚信息通过国家企业信用信息公示系统向社会公示。</p><p align=\"justify\">　　第十五条 对违反本规定第四条的商标代理机构，由知识产权管理部门对其负责人进行整改约谈。</p><p align=\"justify\">　　第十六条 知识产权管理部门、市场监督管理部门应当积极引导申请人依法申请商标注册、商标代理机构依法从事商标代理业务，规范生产经营活动中使用注册商标的行为。</p><p align=\"justify\">　　知识产权管理部门应当进一步畅通商标申请渠道、优化商标注册流程，提升商标公共服务水平，为申请人直接申请注册商标提供便利化服务。</p><p align=\"justify\">　　第十七条 知识产权管理部门应当健全内部监督制度，对从事商标注册工作的国家机关工作人员执行法律、行政法规和遵守纪律的情况加强监督检查。</p><p align=\"justify\">　　从事商标注册工作的国家机关工作人员玩忽职守、滥用职权、徇私舞弊，违法办理商标注册事项，收受当事人财物，牟取不正当利益的，应当依法给予处分；构成犯罪的，依法追究刑事责任。</p><p align=\"justify\">　　第十八条 商标代理行业组织应当完善行业自律规范，加强行业自律，对违反行业自律规范的会员实行惩戒，并及时向社会公布。</p><p align=\"justify\">　　第十九条 本规定自2019年12月1日起施行。</p>', '2020-02-28 00:00:00');
INSERT INTO `haozhi_data` VALUES ('74814649846513132', '2019年四季度全国省市县商标主要统计数据', 'http://q55l2dpen.bkt.clouddn.com/0368850917f64446965138d997153d28', '<img src=\"http://q55l2dpen.bkt.clouddn.com/0f4c57f622084b54b45be3e2c3a2b2b0\" alt=\"undefined\"><br>', '2020-02-01 00:00:00');
INSERT INTO `haozhi_data` VALUES ('7864165141313', '中华人民共和国商标法(根据2019年4月23日第十三届全国人民代表大会常务委员会第十次会议《关于修改〈中华人民共和国建筑法〉等八部法律的决定》第四次修正)', 'http://q55l2dpen.bkt.clouddn.com/f996db1ce413403c985c7af1ac2bf20f', '<div id=\"content-container\" class=\"content-container clearfix\" data-showlog=\"tid:126;cst:1;logInfo:landing;\" data-extralog=\"flow:2;st:news;rid:9934027693638279266;pos:0;extra:;source:1;isBaijiahao:1;login:1;appId:1536766145586974;\" data-ratio=\"1\" data-rid=\"page\"><div id=\"left-container\" class=\"left-container\"><div class=\"item-wrap\"><div class=\"article \" id=\"article\" data-islow-browser=\"0\"><div class=\"article-content\"><p style=\"text-align: center;\"><span>　</span><b><font size=\"5\">中华人民共和国商标法&nbsp;</font></b></p><p style=\"text-align: center;\"><b><font size=\"5\"><br></font></b></p><p>　　（1982年8月23日第五届全国人民代表大会常务委员会第二十四次会议通过　根据1993年2月22日第七届全国人民代表大会常务委员会第三十次会议《关于修改〈中华人民共和国商标法〉的决定》第一次修正　根据2001年10月27日第九届全国人民代表大会常务委员会第二十四次会议《关于修改〈中华人民共和国商标法〉的决定》第二次修正　根据2013年8月30日第十二届全国人民代表大会常务委员会第四次会议《关于修改〈中华人民共和国商标法〉的决定》第三次修正　根据2019年4月23日第十三届全国人民代表大会常务委员会第十次会议《关于修改〈中华人民共和国建筑法〉等八部法律的决定》第四次修正）</p><p>&nbsp;</p><p style=\"text-align: center;\"><span><b>第一章　总　　则</b></span></p><p style=\"text-align: center;\"><span><br></span></p><p>　　第一条　为了加强商标管理，保护商标专用权，促使生产、经营者保证商品和服务质量，维护商标信誉，以保障消费者和生产、经营者的利益，促进社会主义市场经济的发展，特制定本法。</p><p>　　第二条　国务院工商行政管理部门商标局主管全国商标注册和管理的工作。</p><p>　　国务院工商行政管理部门设立商标评审委员会，负责处理商标争议事宜。</p><p>　　第三条　经商标局核准注册的商标为注册商标，包括商品商标、服务商标和集体商标、证明商标；商标注册人享有商标专用权，受法律保护。</p><p>　　本法所称集体商标，是指以团体、协会或者其他组织名义注册，供该组织成员在商事活动中使用，以表明使用者在该组织中的成员资格的标志。</p><p>　　本法所称证明商标，是指由对某种商品或者服务具有监督能力的组织所控制，而由该组织以外的单位或者个人使用于其商品或者服务，用以证明该商品或者服务的原产地、原料、制造方法、质量或者其他特定品质的标志。</p><p>　　集体商标、证明商标注册和管理的特殊事项，由国务院工商行政管理部门规定。</p><p>　　第四条　自然人、法人或者其他组织在生产经营活动中，对其商品或者服务需要取得商标专用权的，应当向商标局申请商标注册。不以使用为目的的恶意商标注册申请，应当予以驳回。</p><p>　　本法有关商品商标的规定，适用于服务商标。</p><p>　　第五条　两个以上的自然人、法人或者其他组织可以共同向商标局申请注册同一商标，共同享有和行使该商标专用权。</p><p>　　第六条　法律、行政法规规定必须使用注册商标的商品，必须申请商标注册，未经核准注册的，不得在市场销售。</p><p>　　第七条　申请注册和使用商标，应当遵循诚实信用原则。</p><p>　　商标使用人应当对其使用商标的商品质量负责。各级工商行政管理部门应当通过商标管理，制止欺骗消费者的行为。</p><p>　　第八条　任何能够将自然人、法人或者其他组织的商品与他人的商品区别开的标志，包括文字、图形、字母、数字、三维标志、颜色组合和声音等，以及上述要素的组合，均可以作为商标申请注册。</p><p>　　第九条　申请注册的商标，应当有显著特征，便于识别，并不得与他人在先取得的合法权利相冲突。</p><p>　　商标注册人有权标明“注册商标”或者注册标记。</p><p>　　第十条　下列标志不得作为商标使用：</p><p>　　（一）同中华人民共和国的国家名称、国旗、国徽、国歌、军旗、军徽、军歌、勋章等相同或者近似的，以及同中央国家机关的名称、标志、所在地特定地点的名称或者标志性建筑物的名称、图形相同的；</p><p>　　（二）同外国的国家名称、国旗、国徽、军旗等相同或者近似的，但经该国政府同意的除外；</p><p>　　（三）同政府间国际组织的名称、旗帜、徽记等相同或者近似的，但经该组织同意或者不易误导公众的除外；</p><p>　　（四）与表明实施控制、予以保证的官方标志、检验印记相同或者近似的，但经授权的除外；</p><p>　　（五）同“红十字”、“红新月”的名称、标志相同或者近似的；</p><p>　　（六）带有民族歧视性的；</p><p>　　（七）带有欺骗性，容易使公众对商品的质量等特点或者产地产生误认的；</p><p>　　（八）有害于社会主义道德风尚或者有其他不良影响的。</p><p>　　县级以上行政区划的地名或者公众知晓的外国地名，不得作为商标。但是，地名具有其他含义或者作为集体商标、证明商标组成部分的除外；已经注册的使用地名的商标继续有效。</p><p>　　第十一条　下列标志不得作为商标注册：</p><p>　　（一）仅有本商品的通用名称、图形、型号的；</p><p>　　（二）仅直接表示商品的质量、主要原料、功能、用途、重量、数量及其他特点的；</p><p>　　（三）其他缺乏显著特征的。</p><p>　　前款所列标志经过使用取得显著特征，并便于识别的，可以作为商标注册。</p><p>　　第十二条　以三维标志申请注册商标的，仅由商品自身的性质产生的形状、为获得技术效果而需有的商品形状或者使商品具有实质性价值的形状，不得注册。</p><p>　　第十三条　为相关公众所熟知的商标，持有人认为其权利受到侵害时，可以依照本法规定请求驰名商标保护。</p><p>　　就相同或者类似商品申请注册的商标是复制、摹仿或者翻译他人未在中国注册的驰名商标，容易导致混淆的，不予注册并禁止使用。</p><p>　　就不相同或者不相类似商品申请注册的商标是复制、摹仿或者翻译他人已经在中国注册的驰名商标，误导公众，致使该驰名商标注册人的利益可能受到损害的，不予注册并禁止使用。</p><p>　　第十四条　驰名商标应当根据当事人的请求，作为处理涉及商标案件需要认定的事实进行认定。认定驰名商标应当考虑下列因素：</p><p>　　（一）相关公众对该商标的知晓程度；</p><p>　　（二）该商标使用的持续时间；</p><p>　　（三）该商标的任何宣传工作的持续时间、程度和地理范围；</p><p>　　（四）该商标作为驰名商标受保护的记录；</p><p>　　（五）该商标驰名的其他因素。</p><p>　　在商标注册审查、工商行政管理部门查处商标违法案件过程中，当事人依照本法第十三条规定主张权利的，商标局根据审查、处理案件的需要，可以对商标驰名情况作出认定。</p><p>　　在商标争议处理过程中，当事人依照本法第十三条规定主张权利的，商标评审委员会根据处理案件的需要，可以对商标驰名情况作出认定。</p><p>　　在商标民事、行政案件审理过程中，当事人依照本法第十三条规定主张权利的，最高人民法院指定的人民法院根据审理案件的需要，可以对商标驰名情况作出认定。</p><p>　　生产、经营者不得将“驰名商标”字样用于商品、商品包装或者容器上，或者用于广告宣传、展览以及其他商业活动中。</p><p>　　第十五条　未经授权，代理人或者代表人以自己的名义将被代理人或者被代表人的商标进行注册，被代理人或者被代表人提出异议的，不予注册并禁止使用。</p><p>　　就同一种商品或者类似商品申请注册的商标与他人在先使用的未注册商标相同或者近似，申请人与该他人具有前款规定以外的合同、业务往来关系或者其他关系而明知该他人商标存在，该他人提出异议的，不予注册。</p><p>　　第十六条　商标中有商品的地理标志，而该商品并非来源于该标志所标示的地区，误导公众的，不予注册并禁止使用；但是，已经善意取得注册的继续有效。</p><p>　　前款所称地理标志，是指标示某商品来源于某地区，该商品的特定质量、信誉或者其他特征，主要由该地区的自然因素或者人文因素所决定的标志。</p><p>　　第十七条　外国人或者外国企业在中国申请商标注册的，应当按其所属国和中华人民共和国签订的协议或者共同参加的国际条约办理，或者按对等原则办理。</p><p>　　第十八条　申请商标注册或者办理其他商标事宜，可以自行办理，也可以委托依法设立的商标代理机构办理。</p><p>　　外国人或者外国企业在中国申请商标注册和办理其他商标事宜的，应当委托依法设立的商标代理机构办理。</p><p>　　第十九条　商标代理机构应当遵循诚实信用原则，遵守法律、行政法规，按照被代理人的委托办理商标注册申请或者其他商标事宜；对在代理过程中知悉的被代理人的商业秘密，负有保密义务。</p><p>　　委托人申请注册的商标可能存在本法规定不得注册情形的，商标代理机构应当明确告知委托人。</p><p>　　商标代理机构知道或者应当知道委托人申请注册的商标属于本法第四条、第十五条和第三十二条规定情形的，不得接受其委托。</p><p>　　商标代理机构除对其代理服务申请商标注册外，不得申请注册其他商标。</p><p>　　第二十条　商标代理行业组织应当按照章程规定，严格执行吸纳会员的条件，对违反行业自律规范的会员实行惩戒。商标代理行业组织对其吸纳的会员和对会员的惩戒情况，应当及时向社会公布。</p><p>　　第二十一条　商标国际注册遵循中华人民共和国缔结或者参加的有关国际条约确立的制度，具体办法由国务院规定。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第二章　商标注册的申请</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第二十二条　商标注册申请人应当按规定的商品分类表填报使用商标的商品类别和商品名称，提出注册申请。</p><p>　　商标注册申请人可以通过一份申请就多个类别的商品申请注册同一商标。</p><p>　　商标注册申请等有关文件，可以以书面方式或者数据电文方式提出。</p><p>　　第二十三条　注册商标需要在核定使用范围之外的商品上取得商标专用权的，应当另行提出注册申请。</p><p>　　第二十四条　注册商标需要改变其标志的，应当重新提出注册申请。</p><p>　　第二十五条　商标注册申请人自其商标在外国第一次提出商标注册申请之日起六个月内，又在中国就相同商品以同一商标提出商标注册申请的，依照该外国同中国签订的协议或者共同参加的国际条约，或者按照相互承认优先权的原则，可以享有优先权。</p><p>　　依照前款要求优先权的，应当在提出商标注册申请的时候提出书面声明，并且在三个月内提交第一次提出的商标注册申请文件的副本；未提出书面声明或者逾期未提交商标注册申请文件副本的，视为未要求优先权。</p><p>　　第二十六条　商标在中国政府主办的或者承认的国际展览会展出的商品上首次使用的，自该商品展出之日起六个月内，该商标的注册申请人可以享有优先权。</p><p>　　依照前款要求优先权的，应当在提出商标注册申请的时候提出书面声明，并且在三个月内提交展出其商品的展览会名称、在展出商品上使用该商标的证据、展出日期等证明文件；未提出书面声明或者逾期未提交证明文件的，视为未要求优先权。</p><p>　　第二十七条　为申请商标注册所申报的事项和所提供的材料应当真实、准确、完整。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第三章　商标注册的审查和核准</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第二十八条　对申请注册的商标，商标局应当自收到商标注册申请文件之日起九个月内审查完毕，符合本法有关规定的，予以初步审定公告。</p><p>　　第二十九条　在审查过程中，商标局认为商标注册申请内容需要说明或者修正的，可以要求申请人做出说明或者修正。申请人未做出说明或者修正的，不影响商标局做出审查决定。</p><p>　　第三十条　申请注册的商标，凡不符合本法有关规定或者同他人在同一种商品或者类似商品上已经注册的或者初步审定的商标相同或者近似的，由商标局驳回申请，不予公告。</p><p>　　第三十一条　两个或者两个以上的商标注册申请人，在同一种商品或者类似商品上，以相同或者近似的商标申请注册的，初步审定并公告申请在先的商标；同一天申请的，初步审定并公告使用在先的商标，驳回其他人的申请，不予公告。</p><p>　　第三十二条　申请商标注册不得损害他人现有的在先权利，也不得以不正当手段抢先注册他人已经使用并有一定影响的商标。</p><p>　　第三十三条　对初步审定公告的商标，自公告之日起三个月内，在先权利人、利害关系人认为违反本法第十三条第二款和第三款、第十五条、第十六条第一款、第三十条、第三十一条、第三十二条规定的，或者任何人认为违反本法第四条、第十条、第十一条、第十二条、第十九条第四款规定的，可以向商标局提出异议。公告期满无异议的，予以核准注册，发给商标注册证，并予公告。</p><p>　　第三十四条　对驳回申请、不予公告的商标，商标局应当书面通知商标注册申请人。商标注册申请人不服的，可以自收到通知之日起十五日内向商标评审委员会申请复审。商标评审委员会应当自收到申请之日起九个月内做出决定，并书面通知申请人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长三个月。当事人对商标评审委员会的决定不服的，可以自收到通知之日起三十日内向人民法院起诉。</p><p>　　第三十五条　对初步审定公告的商标提出异议的，商标局应当听取异议人和被异议人陈述事实和理由，经调查核实后，自公告期满之日起十二个月内做出是否准予注册的决定，并书面通知异议人和被异议人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长六个月。</p><p>　　商标局做出准予注册决定的，发给商标注册证，并予公告。异议人不服的，可以依照本法第四十四条、第四十五条的规定向商标评审委员会请求宣告该注册商标无效。</p><p>　　商标局做出不予注册决定，被异议人不服的，可以自收到通知之日起十五日内向商标评审委员会申请复审。商标评审委员会应当自收到申请之日起十二个月内做出复审决定，并书面通知异议人和被异议人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长六个月。被异议人对商标评审委员会的决定不服的，可以自收到通知之日起三十日内向人民法院起诉。人民法院应当通知异议人作为第三人参加诉讼。</p><p>　　商标评审委员会在依照前款规定进行复审的过程中，所涉及的在先权利的确定必须以人民法院正在审理或者行政机关正在处理的另一案件的结果为依据的，可以中止审查。中止原因消除后，应当恢复审查程序。</p><p>　　第三十六条　法定期限届满，当事人对商标局做出的驳回申请决定、不予注册决定不申请复审或者对商标评审委员会做出的复审决定不向人民法院起诉的，驳回申请决定、不予注册决定或者复审决定生效。</p><p>　　经审查异议不成立而准予注册的商标，商标注册申请人取得商标专用权的时间自初步审定公告三个月期满之日起计算。自该商标公告期满之日起至准予注册决定做出前，对他人在同一种或者类似商品上使用与该商标相同或者近似的标志的行为不具有追溯力；但是，因该使用人的恶意给商标注册人造成的损失，应当给予赔偿。</p><p>　　第三十七条　对商标注册申请和商标复审申请应当及时进行审查。</p><p>　　第三十八条　商标注册申请人或者注册人发现商标申请文件或者注册文件有明显错误的，可以申请更正。商标局依法在其职权范围内作出更正，并通知当事人。</p><p>　　前款所称更正错误不涉及商标申请文件或者注册文件的实质性内容。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第四章　注册商标的续展、变更、转让和使用许可</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第三十九　条注册商标的有效期为十年，自核准注册之日起计算。</p><p>　　第四十条　注册商标有效期满，需要继续使用的，商标注册人应当在期满前十二个月内按照规定办理续展手续；在此期间未能办理的，可以给予六个月的宽展期。每次续展注册的有效期为十年，自该商标上一届有效期满次日起计算。期满未办理续展手续的，注销其注册商标。</p><p>　　商标局应当对续展注册的商标予以公告。</p><p>　　第四十一条　注册商标需要变更注册人的名义、地址或者其他注册事项的，应当提出变更申请。</p><p>　　第四十二条　转让注册商标的，转让人和受让人应当签订转让协议，并共同向商标局提出申请。受让人应当保证使用该注册商标的商品质量。</p><p>　　转让注册商标的，商标注册人对其在同一种商品上注册的近似的商标，或者在类似商品上注册的相同或者近似的商标，应当一并转让。</p><p>　　对容易导致混淆或者有其他不良影响的转让，商标局不予核准，书面通知申请人并说明理由。</p><p>　　转让注册商标经核准后，予以公告。受让人自公告之日起享有商标专用权。</p><p>　　第四十三条　商标注册人可以通过签订商标使用许可合同，许可他人使用其注册商标。许可人应当监督被许可人使用其注册商标的商品质量。被许可人应当保证使用该注册商标的商品质量。</p><p>　　经许可使用他人注册商标的，必须在使用该注册商标的商品上标明被许可人的名称和商品产地。</p><p>　　许可他人使用其注册商标的，许可人应当将其商标使用许可报商标局备案，由商标局公告。商标使用许可未经备案不得对抗善意第三人。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第五章　注册商标的无效宣告</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第四十四条　已经注册的商标，违反本法第四条、第十条、第十一条、第十二条、第十九条第四款规定的，或者是以欺骗手段或者其他不正当手段取得注册的，由商标局宣告该注册商标无效；其他单位或者个人可以请求商标评审委员会宣告该注册商标无效。</p><p>　　商标局做出宣告注册商标无效的决定，应当书面通知当事人。当事人对商标局的决定不服的，可以自收到通知之日起十五日内向商标评审委员会申请复审。商标评审委员会应当自收到申请之日起九个月内做出决定，并书面通知当事人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长三个月。当事人对商标评审委员会的决定不服的，可以自收到通知之日起三十日内向人民法院起诉。</p><p>　　其他单位或者个人请求商标评审委员会宣告注册商标无效的，商标评审委员会收到申请后，应当书面通知有关当事人，并限期提出答辩。商标评审委员会应当自收到申请之日起九个月内做出维持注册商标或者宣告注册商标无效的裁定，并书面通知当事人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长三个月。当事人对商标评审委员会的裁定不服的，可以自收到通知之日起三十日内向人民法院起诉。人民法院应当通知商标裁定程序的对方当事人作为第三人参加诉讼。</p><p>　　第四十五条　已经注册的商标，违反本法第十三条第二款和第三款、第十五条、第十六条第一款、第三十条、第三十一条、第三十二条规定的，自商标注册之日起五年内，在先权利人或者利害关系人可以请求商标评审委员会宣告该注册商标无效。对恶意注册的，驰名商标所有人不受五年的时间限制。</p><p>　　商标评审委员会收到宣告注册商标无效的申请后，应当书面通知有关当事人，并限期提出答辩。商标评审委员会应当自收到申请之日起十二个月内做出维持注册商标或者宣告注册商标无效的裁定，并书面通知当事人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长六个月。当事人对商标评审委员会的裁定不服的，可以自收到通知之日起三十日内向人民法院起诉。人民法院应当通知商标裁定程序的对方当事人作为第三人参加诉讼。</p><p>　　商标评审委员会在依照前款规定对无效宣告请求进行审查的过程中，所涉及的在先权利的确定必须以人民法院正在审理或者行政机关正在处理的另一案件的结果为依据的，可以中止审查。中止原因消除后，应当恢复审查程序。</p><p>　　第四十六条　法定期限届满，当事人对商标局宣告注册商标无效的决定不申请复审或者对商标评审委员会的复审决定、维持注册商标或者宣告注册商标无效的裁定不向人民法院起诉的，商标局的决定或者商标评审委员会的复审决定、裁定生效。</p><p>　　第四十七条　依照本法第四十四条、第四十五条的规定宣告无效的注册商标，由商标局予以公告，该注册商标专用权视为自始即不存在。</p><p>　　宣告注册商标无效的决定或者裁定，对宣告无效前人民法院做出并已执行的商标侵权案件的判决、裁定、调解书和工商行政管理部门做出并已执行的商标侵权案件的处理决定以及已经履行的商标转让或者使用许可合同不具有追溯力。但是，因商标注册人的恶意给他人造成的损失，应当给予赔偿。</p><p>　　依照前款规定不返还商标侵权赔偿金、商标转让费、商标使用费，明显违反公平原则的，应当全部或者部分返还。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第六章　商标使用的管理</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第四十八条　本法所称商标的使用，是指将商标用于商品、商品包装或者容器以及商品交易文书上，或者将商标用于广告宣传、展览以及其他商业活动中，用于识别商品来源的行为。</p><p>　　第四十九条　商标注册人在使用注册商标的过程中，自行改变注册商标、注册人名义、地址或者其他注册事项的，由地方工商行政管理部门责令限期改正；期满不改正的，由商标局撤销其注册商标。</p><p>　　注册商标成为其核定使用的商品的通用名称或者没有正当理由连续三年不使用的，任何单位或者个人可以向商标局申请撤销该注册商标。商标局应当自收到申请之日起九个月内做出决定。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长三个月。</p><p>　　第五十条　注册商标被撤销、被宣告无效或者期满不再续展的，自撤销、宣告无效或者注销之日起一年内，商标局对与该商标相同或者近似的商标注册申请，不予核准。</p><p>　　第五十一条　违反本法第六条规定的，由地方工商行政管理部门责令限期申请注册，违法经营额五万元以上的，可以处违法经营额百分之二十以下的罚款，没有违法经营额或者违法经营额不足五万元的，可以处一万元以下的罚款。</p><p>　　第五十二条　将未注册商标冒充注册商标使用的，或者使用未注册商标违反本法第十条规定的，由地方工商行政管理部门予以制止，限期改正，并可以予以通报，违法经营额五万元以上的，可以处违法经营额百分之二十以下的罚款，没有违法经营额或者违法经营额不足五万元的，可以处一万元以下的罚款。</p><p>　　第五十三条　违反本法第十四条第五款规定的，由地方工商行政管理部门责令改正，处十万元罚款。</p><p>　　第五十四条　对商标局撤销或者不予撤销注册商标的决定，当事人不服的，可以自收到通知之日起十五日内向商标评审委员会申请复审。商标评审委员会应当自收到申请之日起九个月内做出决定，并书面通知当事人。有特殊情况需要延长的，经国务院工商行政管理部门批准，可以延长三个月。当事人对商标评审委员会的决定不服的，可以自收到通知之日起三十日内向人民法院起诉。</p><p>　　第五十五条　法定期限届满，当事人对商标局做出的撤销注册商标的决定不申请复审或者对商标评审委员会做出的复审决定不向人民法院起诉的，撤销注册商标的决定、复审决定生效。</p><p>　　被撤销的注册商标，由商标局予以公告，该注册商标专用权自公告之日起终止。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第七章　注册商标专用权的保护</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第五十六条　注册商标的专用权，以核准注册的商标和核定使用的商品为限。</p><p>　　第五十七条　有下列行为之一的，均属侵犯注册商标专用权：</p><p>　　（一）未经商标注册人的许可，在同一种商品上使用与其注册商标相同的商标的；</p><p>　　（二）未经商标注册人的许可，在同一种商品上使用与其注册商标近似的商标，或者在类似商品上使用与其注册商标相同或者近似的商标，容易导致混淆的；</p><p>　　（三）销售侵犯注册商标专用权的商品的；</p><p>　　（四）伪造、擅自制造他人注册商标标识或者销售伪造、擅自制造的注册商标标识的；</p><p>　　（五）未经商标注册人同意，更换其注册商标并将该更换商标的商品又投入市场的；</p><p>　　（六）故意为侵犯他人商标专用权行为提供便利条件，帮助他人实施侵犯商标专用权行为的；</p><p>　　（七）给他人的注册商标专用权造成其他损害的。</p><p>　　第五十八条　将他人注册商标、未注册的驰名商标作为企业名称中的字号使用，误导公众，构成不正当竞争行为的，依照《中华人民共和国反不正当竞争法》处理。</p><p>　　第五十九条　注册商标中含有的本商品的通用名称、图形、型号，或者直接表示商品的质量、主要原料、功能、用途、重量、数量及其他特点，或者含有的地名，注册商标专用权人无权禁止他人正当使用。</p><p>　　三维标志注册商标中含有的商品自身的性质产生的形状、为获得技术效果而需有的商品形状或者使商品具有实质性价值的形状，注册商标专用权人无权禁止他人正当使用。</p><p>　　商标注册人申请商标注册前，他人已经在同一种商品或者类似商品上先于商标注册人使用与注册商标相同或者近似并有一定影响的商标的，注册商标专用权人无权禁止该使用人在原使用范围内继续使用该商标，但可以要求其附加适当区别标识。</p><p>　　第六十条　有本法第五十七条所列侵犯注册商标专用权行为之一，引起纠纷的，由当事人协商解决；不愿协商或者协商不成的，商标注册人或者利害关系人可以向人民法院起诉，也可以请求工商行政管理部门处理。</p><p>　　工商行政管理部门处理时，认定侵权行为成立的，责令立即停止侵权行为，没收、销毁侵权商品和主要用于制造侵权商品、伪造注册商标标识的工具，违法经营额五万元以上的，可以处违法经营额五倍以下的罚款，没有违法经营额或者违法经营额不足五万元的，可以处二十五万元以下的罚款。对五年内实施两次以上商标侵权行为或者有其他严重情节的，应当从重处罚。销售不知道是侵犯注册商标专用权的商品，能证明该商品是自己合法取得并说明提供者的，由工商行政管理部门责令停止销售。</p><p>　　对侵犯商标专用权的赔偿数额的争议，当事人可以请求进行处理的工商行政管理部门调解，也可以依照《中华人民共和国民事诉讼法》向人民法院起诉。经工商行政管理部门调解，当事人未达成协议或者调解书生效后不履行的，当事人可以依照《中华人民共和国民事诉讼法》向人民法院起诉。</p><p>　　第六十一条　对侵犯注册商标专用权的行为，工商行政管理部门有权依法查处；涉嫌犯罪的，应当及时移送司法机关依法处理。</p><p>　　第六十二条　县级以上工商行政管理部门根据已经取得的违法嫌疑证据或者举报，对涉嫌侵犯他人注册商标专用权的行为进行查处时，可以行使下列职权：</p><p>　　（一）询问有关当事人，调查与侵犯他人注册商标专用权有关的情况；</p><p>　　（二）查阅、复制当事人与侵权活动有关的合同、发票、账簿以及其他有关资料；</p><p>　　（三）对当事人涉嫌从事侵犯他人注册商标专用权活动的场所实施现场检查；</p><p>　　（四）检查与侵权活动有关的物品；对有证据证明是侵犯他人注册商标专用权的物品，可以查封或者扣押。</p><p>　　工商行政管理部门依法行使前款规定的职权时，当事人应当予以协助、配合，不得拒绝、阻挠。</p><p>　　在查处商标侵权案件过程中，对商标权属存在争议或者权利人同时向人民法院提起商标侵权诉讼的，工商行政管理部门可以中止案件的查处。中止原因消除后，应当恢复或者终结案件查处程序。</p><p>　　第六十三条　侵犯商标专用权的赔偿数额，按照权利人因被侵权所受到的实际损失确定；实际损失难以确定的，可以按照侵权人因侵权所获得的利益确定；权利人的损失或者侵权人获得的利益难以确定的，参照该商标许可使用费的倍数合理确定。对恶意侵犯商标专用权，情节严重的，可以在按照上述方法确定数额的一倍以上五倍以下确定赔偿数额。赔偿数额应当包括权利人为制止侵权行为所支付的合理开支。</p><p>　　人民法院为确定赔偿数额，在权利人已经尽力举证，而与侵权行为相关的账簿、资料主要由侵权人掌握的情况下，可以责令侵权人提供与侵权行为相关的账簿、资料；侵权人不提供或者提供虚假的账簿、资料的，人民法院可以参考权利人的主张和提供的证据判定赔偿数额。</p><p>　　权利人因被侵权所受到的实际损失、侵权人因侵权所获得的利益、注册商标许可使用费难以确定的，由人民法院根据侵权行为的情节判决给予五百万元以下的赔偿。</p><p>　　人民法院审理商标纠纷案件，应权利人请求，对属于假冒注册商标的商品，除特殊情况外，责令销毁；对主要用于制造假冒注册商标的商品的材料、工具，责令销毁，且不予补偿；或者在特殊情况下，责令禁止前述材料、工具进入商业渠道，且不予补偿。</p><p>　　假冒注册商标的商品不得在仅去除假冒注册商标后进入商业渠道。</p><p>　　第六十四条　注册商标专用权人请求赔偿，被控侵权人以注册商标专用权人未使用注册商标提出抗辩的，人民法院可以要求注册商标专用权人提供此前三年内实际使用该注册商标的证据。注册商标专用权人不能证明此前三年内实际使用过该注册商标，也不能证明因侵权行为受到其他损失的，被控侵权人不承担赔偿责任。</p><p>　　销售不知道是侵犯注册商标专用权的商品，能证明该商品是自己合法取得并说明提供者的，不承担赔偿责任。</p><p>　　第六十五条　商标注册人或者利害关系人有证据证明他人正在实施或者即将实施侵犯其注册商标专用权的行为，如不及时制止将会使其合法权益受到难以弥补的损害的，可以依法在起诉前向人民法院申请采取责令停止有关行为和财产保全的措施。</p><p>　　第六十六条　为制止侵权行为，在证据可能灭失或者以后难以取得的情况下，商标注册人或者利害关系人可以依法在起诉前向人民法院申请保全证据。</p><p>　　第六十七条　未经商标注册人许可，在同一种商品上使用与其注册商标相同的商标，构成犯罪的，除赔偿被侵权人的损失外，依法追究刑事责任。</p><p>　　伪造、擅自制造他人注册商标标识或者销售伪造、擅自制造的注册商标标识，构成犯罪的，除赔偿被侵权人的损失外，依法追究刑事责任。</p><p>　　销售明知是假冒注册商标的商品，构成犯罪的，除赔偿被侵权人的损失外，依法追究刑事责任。</p><p>　　第六十八条　商标代理机构有下列行为之一的，由工商行政管理部门责令限期改正，给予警告，处一万元以上十万元以下的罚款；对直接负责的主管人员和其他直接责任人员给予警告，处五千元以上五万元以下的罚款；构成犯罪的，依法追究刑事责任：</p><p>　　（一）办理商标事宜过程中，伪造、变造或者使用伪造、变造的法律文件、印章、签名的；</p><p>　　（二）以诋毁其他商标代理机构等手段招徕商标代理业务或者以其他不正当手段扰乱商标代理市场秩序的；</p><p>　　（三）违反本法第四条、第十九条第三款和第四款规定的。</p><p>　　商标代理机构有前款规定行为的，由工商行政管理部门记入信用档案；情节严重的，商标局、商标评审委员会并可以决定停止受理其办理商标代理业务，予以公告。</p><p>　　商标代理机构违反诚实信用原则，侵害委托人合法利益的，应当依法承担民事责任，并由商标代理行业组织按照章程规定予以惩戒。</p><p>　　对恶意申请商标注册的，根据情节给予警告、罚款等行政处罚；对恶意提起商标诉讼的，由人民法院依法给予处罚。</p><p>　　第六十九条　从事商标注册、管理和复审工作的国家机关工作人员必须秉公执法，廉洁自律，忠于职守，文明服务。</p><p>　　商标局、商标评审委员会以及从事商标注册、管理和复审工作的国家机关工作人员不得从事商标代理业务和商品生产经营活动。</p><p>　　第七十条　工商行政管理部门应当建立健全内部监督制度，对负责商标注册、管理和复审工作的国家机关工作人员执行法律、行政法规和遵守纪律的情况，进行监督检查。</p><p>　　第七十一条　从事商标注册、管理和复审工作的国家机关工作人员玩忽职守、滥用职权、徇私舞弊，违法办理商标注册、管理和复审事项，收受当事人财物，牟取不正当利益，构成犯罪的，依法追究刑事责任；尚不构成犯罪的，依法给予处分。</p><p>&nbsp;</p><p style=\"text-align: center;\"><b>第八章　附　　则</b></p><p style=\"text-align: center;\">&nbsp;</p><p>　　第七十二条　申请商标注册和办理其他商标事宜的，应当缴纳费用，具体收费标准另定。</p><p>　　第七十三条　本法自1983年3月1日起施行。1963年4月10日国务院公布的《商标管理条例》同时废止；其他有关商标管理的规定，凡与本法抵触的，同时失效。</p><p>　　本法施行前已经注册的商标继续有效。</p></div></div></div></div><div id=\"right-container\" class=\"right-container\"><div class=\"item-wrap\"><div class=\"related-news\"><div class=\"news-content \"><ul><li data-showlog=\"tid:136;cst:1;logInfo:related_news;\" data-extralog=\"flow:2;rid:;pos:4;extra:;isBaiJiaHao:1;login:1;\" data-rid=\"related_news_4\"><div class=\"item-content clearfix\"></div></li></ul></div></div><div id=\"relateAd\" ad-id=\"relate-js\" class=\"wangmeng-ad\" data-showlog=\"tid:369;cst:1;logInfo:adsjs;\" data-clklog=\"tid:370;cst:2;logInfo:adsjs;\" data-extralog=\"rid:;pos:5;extra:;baijiahao:1;login:1;\"></div></div></div></div>', '2019-12-25 00:00:00');
