INSERT INTO `haozhi_regard` VALUES (1, '<p class=\"MsoNormal\"><span><font face=\"宋体\">好智（天津）企业管理咨询有限责任公司（以下简称“好智咨询”），是专注于服务知产从业者自由执业的互联网兼职平台，好智咨询具备商标、版权的全业务国家认证资质。好智咨询拥有平均从业经验十年以上的商标代理人团队，案件代理人来自原贸促会等知名代理机构，代理人团队</font>80%<font face=\"宋体\">以上具备法本背景，人均办理案件过万，擅长解决疑难案件、经验丰富。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"宋体\">好智咨询秉承</font>“助人致富、共赢发展”的理念构建平台核心规则，为会员提供多种收入模式：自有业务赚高额差价、发展团队赚<font face=\"Calibri\">30%</font><font face=\"宋体\">团队公佣、特约代理人赚高额案件提成；好智咨询持续的产品创新、体验创新、不断迭代，能够为会员提供更专业、便捷、高效的业务支持，促进会员更高效的开展业务，降低会员的业务开发难度、提高客户转化效率，促进会员实现效率倍增、财富倍增、成就倍增。</font></span><span><o:p></o:p></span></p>');
INSERT INTO `haozhi_register_agreement` VALUES (1, '<p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align: center;\"><b><span>好智咨询</span></b><b><span>平台</span></b><b><span>兼职</span></b><b><span>协议</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>甲方：</span></b><b><span>好智（天津）企业管理咨询有限责任公司</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>联系电话：</span><span>022-59267955 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span>电子邮箱：</span><span>haozhizixun@163.com</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>企业</span><span>地址：</span><span><font face=\"宋体\">天津市滨海高新区华苑产业区海泰信息广场海泰大厦</font>5F（天津知识产权局楼上）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\">乙方：<u>以代理人在平台注册的账号信息为准</u></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>甲方是拥有商标</span><span>业务</span><span>资质及网络</span><span>服务工具</span><span>的服务平台，</span><span>乙方具备客户</span><span>开发服务</span><span>能力，同时至少具备商标申请业务的业务处理能力</span><span>，</span><span>双方就乙方利用甲方服务平台（</span><span>微信商城名称：好智企业咨询</span><span>，以下简称：</span><span>好智咨询</span><span>）为其客户提供知识产权相关业务服务，本着平等互利、公平共赢、协同发展的原则，就双方共同合作开发客户、处理业务签订本协议。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">第一条</font> <font face=\"宋体\">合作内容</font></span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1、乙方作为甲方的线上兼职人员，按甲方平台上提供的业务范围及服务标准为其用户提供合法、专业、高效的知识产权服务。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2、对于乙方开发的业务，乙方负责代理人部分的处理，甲方负责收款、开具发票、流程递交、及时向官方递交文件、更新订单进展以及官文收发。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3、甲方负责提供好智咨询平台服务所需的技术及资源投入，提供品牌、技术、后台流程支持，保证满足乙方办理业务流程的需要。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4、甲方负责好智咨询平台运营维护，保证业务对接以及数据不丢失，如因第三方服务器和平台用户终端设置等问题造成的投诉，甲乙双方应及时沟通确认，并向平台用户进行合理解释，以获得平台用户谅解。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5、乙方通过好智咨询平台为其客户提供平台发布的知产服务，负责具体业务咨询、文件准备、文件签章、审核以及通过平台完成业务下单。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>6、乙方作为兼职人员，不具备劳动法律关系的主体资格，甲方按本协议约定给乙方支付报酬，乙方同意甲方不负责乙方的五险一金缴纳，乙方的健康、安全等责任由乙方自行负责。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>7、乙方以甲方的名义为客户提供的服务，如因服务质量问题引起客户的的投诉，其经济和名誉损失由乙方自行承担，甲方会积极配合妥善处理此类客户投诉的服务工作。 </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>第二条</span></b><b><span>&nbsp;&nbsp;<font face=\"宋体\">服务约定</font></span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1、</span><span>甲方负责</span><span>好智咨询</span><span>平台业务标准的制订，并为乙方提供规范的业务标准流程</span><span>，</span><span>负责平台的日常运营工作。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2、</span><span>甲方负责</span><span>好智咨询</span><span>平台的安全和稳定，负责对服务业务运营状况进行监控，发现异常时应及时通报和处理。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3、</span><span>除非客户投诉到</span><span>好智咨询</span><span>平台或</span><span>好智咨询</span><span>平台为客户转发官方文件以及在乙方的同意下协助乙方解决客户问题，甲方不主动联系乙方在</span><span>好智咨询</span><span>平台上的客户</span><span>、</span><span>不泄露乙方的客户信息。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4、</span><span>乙方应遵守相关法律法规的规定，保证合法、专业、高效的处理客户的业务，如因乙方业务处理失误而引起的责任纠纷，由乙方承担相关责任。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5、</span><span>乙方应提交真实有效的身份证明信息和知识产权服务资格证明文件，用以证明乙方有能力在</span><span>好智咨询</span><span>平台上提供知识产权业务服务；乙方以</span><span>好智咨询</span><span>名义对接的客户应通过</span><span>好智咨询</span><span>平台进行业务办理；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>6、</span><span>如乙方接入的客户向平台投诉乙方服务态度、服务质量和服务效率等，甲方有权进行调查并根据平台规则进行处理</span><span>。</span><span>如乙方在协议有效期内被投诉超过三次，甲方有权单方解除本协议</span><span>，</span><span>同时有权要求乙方承担违约责任；造成甲方损失的，甲方有权向乙方进行追偿。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>7、</span><span>乙方与客户产生服务纠纷，乙方应本着诚实守信，恪守职业道德的原则自行与客户达成和解；</span><span>如</span><span>不能解决的，甲方可协调解决，乙方应积极配合。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>第三条</span></b><b><span>&nbsp;&nbsp;</span></b><b><span>利益分配</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1、</span><span>乙方通过</span><span>好智咨询</span><span>平台产生的业务收入</span><span>标准</span><span>如下：</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"宋体\">业务差价收入：乙方提交的业务，实收代理费减去平台会员标准代理费后的差价扣除</font>7%税费后的金额为乙方佣金。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>团队管理收入：</span><span>乙方</span><span>邀约新兼职人员加入的</span><span>，该新</span><span>兼职人员</span><span>通过乙方在</span><span>好智咨询</span><span>平台的专属二维码信息注册成为线上</span><span>兼职人员</span><span>，该新</span><span>兼职人员</span><span>通过平台</span><span>提交成功的</span><span>业务</span><span><font face=\"宋体\">给乙方按平台会员标准标准代理费（扣除税费</font>7%后）的25%计提佣金；新兼职人员介绍的兼职人员完成业务的给乙方按平台会员标准代理费（扣除税费7%后）的5%计提佣金。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2、</span><span>甲方有权根据实际业务需要</span><span>调整</span><span>分润比例，但</span><span>应</span><span>及时通知乙方。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3、</span><span>结算方式</span><span>：</span><span>在乙方完成承接的案件并递交官方后，</span><span>好智咨询</span><span>平台将按照</span><span>第三条</span><span>所述分润制度，自动核算乙方应得收入。乙方</span><span><font face=\"宋体\">可在次月</font>5日后申请收入提现</span><span>，甲方</span><span><font face=\"宋体\">审核无误后在</font>10个工作</span><span>日将相应款项转汇给乙方。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4、</span><span>乙方同意由平台为其发放薪酬，</span><span>兼职人员</span><span>的收入为税后收入，同意平台为其代扣代缴相应税款。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5、</span><span>乙方为个人的，甲方会代为扣除</span><span>乙方应缴</span><span>税费；乙方为公司的，应在申请提现的同时向甲方提供与提现金额等额的增值税发票，甲方在收到相应的增值税发票后向乙方支付相应的款项。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>6、平台费用包含1次快递费用，产生第2次及以上快递费用的由乙方承担；乙方同意由甲方在乙方佣金中予以扣除。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>7、</span><span>双方费用结算以</span><span>好智咨询</span><span>平台统计结果为准。乙方对</span><span>好智咨询</span><span>平台统计数据有异议，</span><span>可</span><span>通过</span><span>cjedu2005@163.com</span><span>提供书面异议说明，甲方收到该说明后配合找出问题进行解决。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>第四条</span></b><b><span>&nbsp;&nbsp;<font face=\"宋体\">其他约定</font></span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1、</span><span>合作期间，如因政策变化或其它不可抗力因素而必须终止或修改本协议时，双方应本着互谅互让的精神友好协商，共同修改或终止本协议。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2、</span><span>甲乙双方均应遵守</span><span>本协议约定</span><span>。如一方违约，违约方应承担由此带来的法律责任，并赔偿另一方由此带来的损失。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3、</span><span>本协议有效期内，如乙方发布的个人资质和业务内容不符合相关法律法规以及</span><span>好智咨询</span><span>平台要求，经提醒不能及时改正时，甲方有权单方解除本协议，并要求乙方</span><span>承担</span><span>甲方为此所遭受的损失。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4、</span><span>甲乙双方均对平台所涉及的业务及相应的技术具有保密义务</span><span>，</span><span>未经信息的所有权方同意，另一方不得向第三方披露</span><span>。</span><span>因不遵守该条款而引发的后果，由披露方承担全部责任</span><span>；</span><span>本协议规定的保密期限于该信息交付之日起至该项信息被权利人或他人公开之日止。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5、甲方、乙方就本协议项下合作事宜达成的任何补充协议、附件等文件均构成本协议不可分割的一部分，与本协议具有同等法律效力。 </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>6、协议履行过程中若发生争议，双方应协商解决；协商不成，可通过法律途径解决。 </span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>7、乙方在平台勾选确认视为已阅读本协议，且对以上条款充分理解并承诺遵守。</span></p><p class=\"MsoNormal\"><br></p>');
