INSERT INTO `haozhi_yw` VALUES ('10010', '急速注册', 9900, 39900, '<p class=\"MsoNormal\"><b><span>业务说明&nbsp;</span></b><b><span>Service</span></b><b><span>&nbsp;explain</span></b><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>适合一般风险商标注册，降低客户注册成本，提高价格竞争力。</span></p><p class=\"MsoNormal\"><span>无论任何原因导致相关申请被商标局不予受理，免费重新报送。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\">特别提示：下载后的委托书应在一页中包含全部内容，如在手机中显示为两页，则传送至电脑后，用Word打开即可正常显示。</p><p class=\"MsoNormal\"><b><span>流程与周期&nbsp;</span></b><b>Service Introduction</b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标规划及风险检索</span><span>（</span><span>代理人</span><span><font face=\"宋体\">）</font>----</span><span>签约及</span><span>材料准备</span><span>（</span><span>代理人</span><span>）</span><span>----</span><span>商标审核及</span><span>上报（</span><span>好智咨询</span><span><font face=\"宋体\">）</font>----<font face=\"宋体\">形式审查（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">发放受理通知书（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">实质审查（商标局）</font><font face=\"Calibri\">----</font></span><span>商标初审通过</span><span><font face=\"宋体\">公示期（商标局）</font>----<font face=\"宋体\">通知领取商标证书（</font></span><span>好智咨询</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>全部流程需</span><span>10</span><span>个月</span><span>以上</span><span>（国家通用审查周期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>1、</span><!--[endif]--><span>公司营业执照复印件</span><span>加盖公章</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>2、</span><!--[endif]--><span>清晰的商标图样电子版（</span><span>文字商标的可自动生成，默认为宋体</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>商标注册代理协议（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>商标注册代理委托书（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>个人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>身份证复印件</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>个体户营业执照</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>清晰的商标图样电子版</span><span>（</span><span>文字商标的可自动生成，默认为宋体</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>商标注册代理协议（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>商标注册代理委托书（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><span>&nbsp;</span><b>常见问题&nbsp;</b><b>Service Introduction</b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标证的有效期是多长时间？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标证有效期为十年，有效期届满时需向国家商标总局递交下一个有效期的续展申请手续</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标注册成功后，还需要怎样的日常管理？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标注册成功后，如注册人营业执照地址或者名义发生变化，改名义下的所有商标证均要一并进行相应信息的变更</span><span>；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>商标许可他人使用，需向国家商标总局办理商标许可使用备案</span><span>；</span><span>商标转让他人，需向国家商标总局办理商标转让手续。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span><font face=\"宋体\">商标注册申请可</font>100%<font face=\"宋体\">保证成功吗？</font></span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">商标注册在先查询存在</font>3<font face=\"宋体\">到</font><font face=\"Calibri\">6</font><font face=\"宋体\">个月的查询盲</font></span><span>期</span><span>，无法做到百分百的</span><span>风险排除</span><span>，并且在商标近似和禁用条款的审核中</span><span>存在</span><span>很多不能人为把控的风险，因此任何机构承诺百分之百保证通过都是缺乏依据的。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>注册商标的重要性&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>入驻各大商场超市、亚马逊、天猫、京东及其他线下线上平台的通行证</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>申请微信、微博及各种公众号的必备认证</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>办理质检及各种条码的必备条件</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>合法权益受相关法律的全方位保障</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>防止涉嫌侵犯他人权利的被动违法情形发生</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>6<font face=\"宋体\">、</font></span><span>创立企业无形资产，增强品牌价值</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>7<font face=\"宋体\">、</font></span><span>防止他人恶意削弱产品及服务市场份额的强有力保障</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/a34208c07566494e81fb08f8894af092', '10086', '24小时急速申报；48小时取得申报号；国知局文件2个工作日内转发通知；包含1次邮寄费。', '980', '600', 27000, NULL, 'http://haozhiimage.haozhizixun.com/01国内商标注册委托书范本.doc');
