INSERT INTO `haozhi_yw` VALUES ('10016', '商标转让', 19900, 39900, '<p class=\"MsoNormal\"><b><span>流程与周期&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">下达转让证明（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">通知领取转让证明（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">全部流程需</font>4-6<font face=\"宋体\">个月（国家通用审查周期）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>所需材料&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>转让人</span><span>资质证明</span><span>（转让人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>受让人</span><span>资质证明（个人则需提供身份证复印件并签字，个体户执照复印件并盖章）</span><span>（受让人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、《</font></span><span><font face=\"宋体\">同意转让证明</font></span><span><font face=\"宋体\">》并盖章签字（系统下载后签章或签字）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>转让人及受让人代理</span><span>委托书</span><span>（</span><span>系统下载后签章或签字</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">转让</font>/<font face=\"宋体\">受让人资质证明说明：</font></span></b><span>主体为法人的须提供营业执照副本复印件加盖公章；主体为</span><span>个人</span><span>的</span><span>需提供身份证复印件并签字，</span><span>及</span><span>个体户执照复印件并盖章。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\">特别说明：下载后的委托书应在一页中包含全部内容，如在手机中显示为两页，则传送至电脑后，用Word打开即可正常显示。</p><p class=\"MsoNormal\"><b><span><br></span></b></p><p class=\"MsoNormal\"><b><span>常见问题&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标转让与商标注册人名义变更的区别</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标转让是直接导致商标权属发生转移的法律行为，转让完成后，商标权即从原商标注册人转至受让人所有；而商标注册人名义的变更行为是基于该标注册人的名称发生变更后，需向商标总局申请变更的法律行为，该行为并不发生商标权属的改变。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>在何种情况下，需办理商标证的转让手续？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">（</font>1<font face=\"宋体\">）</font><a name=\"ref_2\"></a><font face=\"宋体\">经双方协商一致，商标注册人同意将商标转让给他人的，应当到商标局办理注册商标的转让手续。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"宋体\">（</font>2<font face=\"宋体\">）因企业合并、兼并或改制而发生商标权属</font></span><span>移转的，应当到商标局办理注册商标的移转手续。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"宋体\">（</font>3<font face=\"宋体\">）依法院判决发生商标专用权移转的，也应当办理移转手续。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>办理转让手续最需要注意的是什么？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>同一名义下的相同或者类似商品上的相同或者近似商标应一并办理转让。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>商标转让人应保证该商标转让时的权属无争议</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标转让成功后，是否会重新下发《商标注册证》？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>不会。商标转让成功后，商标局会下发《商标转让证明》，该《证明》与原《商标注册证》合并使用。转让人需将《商标注册证》原件移交受让人。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">何为商标转让？&nbsp;</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标转让即商标注册人按照法律规定的程序与条件，将商标权属转给他人的法律行为。商标转让手续的办理为强制性法律行为，凡意向转移商标权属的，需转让人与受让人共同向商标局提出申请，并经审核通过，方可完成。相关《转让证明》下达后，商标转让发生法律效力。单独私自移交商标证书的行为并不发生商标权属转移的效力。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/859b0d6f588e4284bcb6d90d60f43cbd', '10087', '执业5年以上商标代理人负责案件；24小时提交国知局。', '1500', '900', 45000, NULL, 'http://haozhiimage.haozhizixun.com/02国内商标转让委托书范本.doc');
INSERT INTO `haozhi_yw` VALUES ('10017', '商标变更', 19900, 39900, '<p class=\"MsoNormal\"><b><span>流程与周期&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">下达变更证明（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">通知领取变更证明（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>全部流程需</span><span>2-3</span><span>个月（国家通用审查周期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>公司营业执照复印件</span><span>加盖公章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>《企业名称变更核准通知书》原件（如需变更注册人名义则需要申请人到工商部门开具）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、代理委托书</font></span><span>（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>个人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>身份证复印件</span><span>并签字</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>个体户营业执照</span><span>复印件</span><span>加盖公章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>《企业名称变更核准通知书》原件（如需变更注册人名义则需要申请人到工商部门开具）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、代理委托书</font></span><span>（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标证的变更包括什么内容？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标证变更包括变更商标注册人名义和变更商标注册地址两项内容</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标证需在何种情况下办理变更手续</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>由于商标注册人营业执照上的名义或者地址发生变更导致商标证上的注册人名义或地址与营业执照上的信息不符，需及时向商标总局办理商标注册人名义或者注册地址的变更手续。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>办理变更手续</span></b><b><span>注意事项</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>无论是办理商标注册人名义的变更还是商标注册地址的变更，最需要注意的是应按照法律规定将该名义下的所有商标一并变更。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">商标变更的重要性&nbsp;</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>依据《商标法实施条例》第三十条规定：变更商标注册人名义或者地址的，商标注册人应当将其全部注册商标一并变更；未一并变更的，由商标局通知其限期改正；期满未改正的，视为放弃变更申请，商标局应当书面通知申请人。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>依据《商标法》第四十一条、第四十九条的规定，注册商标需要变更注册人的名义、地址或者其他注册事项的，应当提出变更申请。商标注册人在使用注册商标的过程中，自行改变注册商标、注册人名义、地址或者其他注意事项的，由地方工商行政管理部门责令限期改正；期满不改正的，由商标局撤销其注册商标。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>依据以上法律规定，注册商标所有人不及时对名下商标办理变更手续，已触犯相关法律的规定，属于违法行为，</span><b><span>商标局可依职权对相关商标予以撤销</span></b><span>。同时存在的风险还在于，如该标被其他主体提起撤销，商标局会按照该标备案地址向注册人发放相关通知，如该标未及时变更地址，</span><span>必然</span><span>导致</span><b><span>注册人无法收到相关通知文件</span></b><span>而错过递交证据的时间，其后果必然</span><b><span>导致该商标无效</span></b><span>。因此商标注册人需及时将名下商标办理变更手续。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/f81423e866c24b50b7ab47ddf2b966a8', '10087', '执业5年以上商标代理人负责案件；24小时提交国知局。', '1000', '600', 0, NULL, 'http://q55l2dpen.bkt.clouddn.com/1232201098337587200.doc');
INSERT INTO `haozhi_yw` VALUES ('10018', '许可备案', 19900, 39900, '<p class=\"MsoNormal\"><b><span>流程与周期&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">下达许可备案证明（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">通知领取相关证明（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>全部流程需</span><span>2-3</span><span>个月（国家通用审查周期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>所需材料&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>1、</span><!--[endif]--><span>双方主体资格证明文件</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>2、</span><!--[endif]--><span>代理委托书</span><span>（</span><span>系统下载后签章</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>资格证明文件说明：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>*<font face=\"宋体\">许可人或被许可人为法人的，需提供营业执照复印件并盖章</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>*<font face=\"宋体\">许可人或被许可人为个人的，需提供身份证复印件并签字及个体户营业执照复印件并盖章</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>常见问题&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>什么是商标的使用许可？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标的使用许可，即在不改变商标权属的前提下，商标注册人将该商标许可给他人使用的法律行为。这种许可使用行为一般</span><span>需约定许可</span><span>使用方式、</span><span>许可</span><span>使用</span><span>期限</span><span>、</span><span>许可</span><span>使用的产品范围</span><span>及责任条款</span><span>等核心事宜。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、如双方签订</font></span></b><b><span>《商标使用许可合同》</span></b><b><span>，则</span></b><b><span>应至少包含哪些核心条款？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">核心条款一般应包括：</font> (1)<font face=\"宋体\">许可使用的商标及注册号；</font><font face=\"Calibri\">(2)</font><font face=\"宋体\">许可使用的商品范围；</font><font face=\"Calibri\">(3)</font><font face=\"宋体\">许可的方式；</font><font face=\"Calibri\">(4) </font><font face=\"宋体\">许可使用的</font></span><span>具体期限</span><span><font face=\"宋体\">；</font>(5)<font face=\"宋体\">许可使用商标的标识提供方式；</font><font face=\"Calibri\">(6)</font><font face=\"宋体\">许可人对被许可人使用其注册商标的商品质量进行监督的条款；（</font><font face=\"Calibri\">7</font><font face=\"宋体\">）在使用许可人注册商标的商品上标明被许可人的名称和商品产地条款。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>3、</span><!--[endif]--><b><span>办理商标使用许可备案时</span></b><b><span>的注意事项</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">（</font>1<font face=\"宋体\">）许可使用的期限不能超过该商标证书的有效期（</font><font face=\"Calibri\">2</font><font face=\"宋体\">）许可使用的商品范围不能超过该商标证书中记载的有效商品范围（</font><font face=\"Calibri\">3</font><font face=\"宋体\">）使用许可备案手续应在《许可使用合同》签订后</font><font face=\"Calibri\">3</font><font face=\"宋体\">个月内向商标总局提交办理。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">商标使用许可备案的重要性&nbsp;</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、《商标法》第四十三条中规定“许可他人使用其注册商标的，许可人应当将其商标使用许可报商标局备案，由商标局公告。商标使用许可未经备案不得对抗善意第三人。”根据以上法律规定，商标使用许可首先应当签订使用许可合同，其次应按法律规定将该许可事宜报商标局备案。但该备案手续并非强制办理，即使没有办理备案手续，其许可合同仍旧有效，但该合同无法对抗善意第三人。换句话说，如商标许可人违背其与被许可人之前的协定，将该标再许可善意第三人，被许可人将无法维权。若被许可人违背《许可合同》中的核心规定违约使用商标，许可人在维权上亦会十分艰难。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、将《商标使用许可合同》报商标局备案后，《备案证明》结合被许可人实际使用商标的证据可视为商标许可人对商标的实际使用，因此可避免该商标被撤销的风险发生。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、商标是注册人重要的无形资产，合法持续使用商标可同时保护商标注册人以及被许可人的合法权利。商标使用许可一经备案，即具有公信力，取得法律上认可的对抗力。同时，《商标法》第六十三条规定“权利人因被侵权所受到的实际损失、侵权人因侵权所获得的利益、注册商标许可使用费难以确定的，由人民法院根据侵权行为的情节判决给予</font></span><span>五</span><span><font face=\"宋体\">百万以下的赔偿</font>”。因此企业还可借助我国对商标专用权保护的力度，遇到商标侵权行为时，为企业获得补偿，从而更好地维护商标的合法权益。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><br clear=\"all\"></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/17ab717cefb345afa0fb942c8b01442d', '10087', '执业5年以上商标代理人负责案件；24小时提交国知局。', '800', '550', 13500, NULL, 'http://haozhiimage.haozhizixun.com/04国内商标许可合同委托书范本.doc');
INSERT INTO `haozhi_yw` VALUES ('10019', '商标续展', 19900, 39900, '<p class=\"MsoNormal\"><b><span>流程与周期&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">下达续展证明（商标局）</font><font face=\"Calibri\">----</font><font face=\"宋体\">通知领取续展证明（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>全部流程需</span><span>2-3</span><span>个月（国家通用审查周期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>所需材料&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>公司营业执照</span><span>复印件并盖章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>个人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>身份证复印件</span><span>并签字</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>个体户营业执照</span><span>复印件并签字</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>常见问题&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标证的有效期是多长时间？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标证有效期为十年，有效期届满时需向国家商标总局递交下一个有效期的续展申请手续。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标证逾期未办理续展手续将导致的法律后果是什么？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标证无效。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标证逾期后，可采取何种补救措施？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标证有效期届满后六个月内，如仍需保留该证书有效期，可申请办理宽展手续。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">商标续展的意义&nbsp;</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">商标注册成功后，有效期为</font>10<font face=\"宋体\">年，商标有效期届满后，如注册人仍需保留该商标的有效性，需向国家商标总局申请延续有效期限，即续展。在该商标有效期届满前一年即进入续展期，可向商标总局提起续展。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>如该标有效期届满时未办理续展手续，则该标失效，在该标有效期届满后六个月内为宽展期，注册人如需延续该标有效期，亦可在此期间向商标总局提出宽展申请。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/b74e3274808d430db2289dbd68c264bf', '10087', '执业5年以上商标代理人负责案件；24小时提交国知局。', '2500', '900', 45000, NULL, 'http://haozhiimage.haozhizixun.com/05国内商标续展委托书范本.doc');
