INSERT INTO `haozhi_yw` VALUES ('10023', '商标驳回复审', 89900, 259900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">证据材料搜集（代理机构）</font>------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">形式审查（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">发放受理通知书（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">实质审查，下达裁决（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标注册被驳回的原因</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标注册申请递交之后，如在实质审查过程中被商标局认定为触犯商标注册禁用条款或者与他人在先申请商标构成相同或者类似商品上的相同或近似商标，均会被予以驳回。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>驳回复审的意义</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>由于驳回复审由</span><span>商标局评审业务处</span><span>行驶审查权，而商标注册则由商标局</span><span>申请处</span><span>行使审查权，因此驳回复审</span><span>于商标注册申请</span><span>在审查</span><span>部门</span><span>及审查员的配备上完全不同；且驳回复审的审核内容除商标在禁用条款及近似性上的因素之外，同时会考虑该标申请人是否存在主观恶意、该标的实际使用及宣传程度、知名度等情况综合考评与引证商标是否存在实际混淆的可能性。因此对被驳回商标进行复审则可大大提升该标被核准通过的可能性，建议企业合理行使法律赋予的该项权利。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>驳回复审如未成功怎么办</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>如驳回复审未能成功，则可继续启用司法救济途径，或者考虑将该商标变更方案重新申报注册。同时可考虑加急有偿受让第三方商标权属为己所用。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><br clear=\"all\"></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/5e5101f64f3948d189c115c9caddd153', '10089', '资深商标代理人撰写案件；', '3500', '2350', 75000, NULL, 'http://haozhiimage.haozhizixun.com/11驳回商标注册申请复审案.doc');
INSERT INTO `haozhi_yw` VALUES ('20024', '商标异议申请', 109900, 289900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">证据材料搜集（代理机构）</font>------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">形式审查（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">发放受理通知书（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">实质审查，下达裁决（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">通知申请人并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标异议权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>自商标初审之日起三个月内，为该商标异议公告期。该期限即为异议申请人的权利期限。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标异议申请的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标注册申请递交后，商标局在审核时仅会针对商标禁用条款和近似性进行审核，而关于该标与其他在先权利的冲突是需要在先权利人于该标异议公告期内自行提起，异议公告期满后没有主体提出异议，该标正式成为注册商标。因此该异议申请即成为在先权利人的最后一道防护屏障，意义极大。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标异议申请的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标异议申请可由申请人自行向国家商标总局提出，亦可委托专业商标代理机构代为提出，因该申请涉及法律专业撰写及证据材料搜集整理，专业性极强，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标异议申请的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>异议申请分两种法律后果：其一，该申请通过商标局的审核，则对方商标不予注册；其二，该申请未通过商标局的审核，则对方商标正式成为注册商标。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>什么是</span></b><b><span><font face=\"宋体\">商标异议申请？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">《中华人民共和国商标法》第三十条</font>:<font face=\"宋体\">对初步审定的商标</font><font face=\"Calibri\">,</font><font face=\"宋体\">自公告之日起三个月内</font><font face=\"Calibri\">,</font><font face=\"宋体\">任何人均可以提出异议。公告期满无异议的</font><font face=\"Calibri\">,</font><font face=\"宋体\">予以核准注册</font><font face=\"Calibri\">,</font><font face=\"宋体\">发给商标注册证</font><font face=\"Calibri\">,</font><font face=\"宋体\">并予公告。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span><font face=\"宋体\">《中华人民共和国商标法》第三十一条</font>:<font face=\"宋体\">申请商标注册不得损害他人现有的在先权利</font><font face=\"Calibri\">,</font><font face=\"宋体\">也不得以不正当手段抢先注册他人已经使用并有一定影响的商标。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>根据以上法律规定，在先权利人如发现正在申请中的商标对自有商标构成抢注或者混淆，可在该商标三个月的异议公告期内向国家商标局提出异议申请并附详细的理由及证据材料。如该申请被商标局采纳，对方商标则不予核发商标证书；如该申请未被商标局采纳或者没有任何主体在权利期内提出相关异议申请，该申请中商标则可成为正式的注册商标同时享有全部的相关权利。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/f0ffd4b6d8cc44ff883429271d5a5141', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '3500', '2200', 50000, NULL, 'http://haozhiimage.haozhizixun.com/08国内商标异议委托书范本.doc');
INSERT INTO `haozhi_yw` VALUES ('20025', '商标异议答辩', 169900, 289900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">证据材料搜集（代理机构）</font>------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">下达裁决（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">通知申请人领取裁定并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标异议答辩权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到异议卷宗及《异议答辩通知书》之日起</font>30<font face=\"宋体\">日内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标异议答辩的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>对方异议卷宗的理由及证据材料均是针对该商标不宜被核准注册而撰写和整理，对商标申请人必然十分不利。如不进行答辩意见，则无法将对方的理由及证据以一种有效的途径进行辩驳，该标极易被商标局下达不予注册裁定。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标异议答辩的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标异议答辩可由申请人自行向国家商标总局提出，亦可委托专业商标代理机构代为提出，因该事务涉及法律专业撰写及证据材料搜集整理，专业性极强，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标异议答辩的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>异议答辩分两种法律后果：其一，该答辩意见通过商标局的审核，则商标正式审核通过成为注册商标；其二，该答辩意见未通过商标局的审核，则商标被裁定不予注册。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>什么是</span></b><b><span>商标异议答辩？</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">申请注册的商标进入异议公告期后，在先权利人可对该标提出异议申请，商标局根据该异议申请启动商标异议审理程序，将该异议申请材料副本及《异议答辩通知书》一并下发至商标注册申请人（如商标注册经代理机构递交，则该卷宗下发至代理机构），限定商标注册申请人在收到相关通知</font>30<font face=\"宋体\">日内对异议做出答辩意见，期满未答辩的，不影响异议程序的进行。而商标注册申请人基于异议人提起的申请在法定期限内以书面形式递交相关辩驳意见及证据材料的法律行为，即为商标的异议答辩。</font></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/dc4c7566b977490daee14a29af7f8bc2', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '3500', '2200', 0, NULL, 'http://haozhiimage.haozhizixun.com/09国内商标异议答辩委托书范本.doc');
INSERT INTO `haozhi_yw` VALUES ('20026', '商标撤三申请', 59900, 89900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>法律文书撰写</span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查</font></span><span>并</span><span><font face=\"宋体\">下达裁决（商标局）</font>------<font face=\"宋体\">通知申请人并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标撤销申请提出的时间性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">以无正当理由连续</font>3<font face=\"宋体\">年不使用为由申请撤销注册商标的，应当自该注册商标注册公告之日起满</font><font face=\"Calibri\">3</font><font face=\"宋体\">年后提出。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标撤销申请的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标撤销申请可由申请人自行向国家商标总局提出，亦可委托专业商标代理机构代为提出，因该申请涉及法律专业撰写，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标撤销申请的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>撤销申请分两种法律后果：其一，对方既无未使用注册商标的正当理由，亦提供不出来针对注册商标的实际使用证据或者提供的证据不足以证明对该注册商标的实际使用，则该商标被商标局予以撤销；其二，对方存在未实际使用注册商标的正当理由或者已提供实际使用证据，则该商标继续有效。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">什么是商标撤销三年不使用申请？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">根据《商标法》相关规定，注册商标存在无正当理由连续</font>3<font face=\"宋体\">年不使用情形的，任何单位或者个人均可向商标局申请撤销该注册商标，该申请即指对注册商标的撤销三年不使用申请。</font></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/a1c393da30da45deb8b418886c9e2ddc', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '3000', '1200', 50000, NULL, 'http://haozhiimage.haozhizixun.com/10国内商标撤三委托书范本.doc');
INSERT INTO `haozhi_yw` VALUES ('20027', '商标撤三答辩', 149900, 259900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">使用证据材料整理（代理机构）</font>------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查，下达裁决（商标局）</font><font face=\"Calibri\">------</font><font face=\"宋体\">通知申请人并专业讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>证据材料整理（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标撤销答辩的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标撤销答辩与其他商标答辩类事务的最大区别在于，如商标注册人不进行该答辩事宜或者未按期递交实际使用证据，则该商标必定被商标局予以撤销。因此进行商标撤销答辩是使该商标继续有效的唯一途径，商标注册人必须要进行的答辩事务。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标撤销答辩的权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到通知之日起</font>2<font face=\"宋体\">个月内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标撤销答辩的方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标撤销答辩可由申请人自行向国家商标总局递交，亦可委托专业商标代理机构代为提出，因该事务涉及证据材料整理及法律文书撰写，专业性极强，因此一般情况下均由代理机构代为做出。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标撤销答辩的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">撤销答辩分两种法律后果：其一，答辩人在</font>2<font face=\"宋体\">个月的权利期限内未提供使用证据或者证据材料无效并没有未使用的正当理由，则该商标被商标局予以撤销；其二，答辩人按期提供了有效的实际使用证据，则该商标继续有效。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>什么是商标撤销三年不使用答辩？</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">根据《商标法》相关规定，注册商标存在无正当理由连续</font>3<font face=\"宋体\">年不使用情形的，任何单位或者个人均可向商标局申请撤销该注册商标，商标局受理后应当通知商标注册人，限其自收到通知之日起</font><font face=\"Calibri\">2</font><font face=\"宋体\">个月内提交该商标在撤销申请提出前使用的证据材料或者说明不使用的正当理由，即指商标撤销三年不使用答辩，也称“提供使用证据”。</font></span><b><span><o:p></o:p></span></b></p>', 'http://q55l2dpen.bkt.clouddn.com/ce02cb5c35544d978fee44852953d503', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '无', '2000', 0, NULL, 'http://q55l2dpen.bkt.clouddn.com/商标评审委托书.doc');
INSERT INTO `haozhi_yw` VALUES ('20028', '商标无效宣告', 269900, 499900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">证据材料搜集（代理机构）</font>-------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查</font></span><span>并</span><span>下达裁决（商标</span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>自该商标成功注册五年内，任何主体均可提出，驰名商标所有人的维权期限或对恶意注册人不受五年时间局限</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>无效宣告的商标范围</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">无效宣告即针对注册成功</font>5<font face=\"宋体\">年之内的注册商标提出。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告申请的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标无效宣告申请可由申请人自行向国家商标</span><span>局</span><span>提出，亦可委托专业商标代理机构代为提出，因该申请涉及法律专业撰写及证据材料搜集整理，专业性极强，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告申请的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>无效宣告申请分两种法律后果：其一，该申请通过商标</span><span>局</span><span>的审核，则宣告注册商标无效；其二，该申请未通过商标</span><span>局</span><span>的审核，则对方注册商标仍然有效。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">商标无效宣告申请是指什么？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>自商标注册成功之日起五年内（驰名商标所有人的维权期限或对恶意注册人不受五年时间局限），</span><span>利害关系</span><span>主体如发现该商标侵犯了其在先权利或者违反了《商标法》第十条、第十一条及第十二条的相关规定，均可向商标</span><span>局</span><span>对该商标提出无效宣告申请。如该申请理由被商标</span><span>局</span><span>支持，即宣告该注册商标无效。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/fb1e27f3909e400d99a24ed794777a45', '10089', '资深金牌代理人专人负责案件；执业15年以上，代理案件数万。', '4000', '2750', 75000, NULL, 'http://haozhiimage.haozhizixun.com/12注册商标无效宣告案.doc');
INSERT INTO `haozhi_yw` VALUES ('20029', '商标无效宣告答辩', 339900, 599900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">证据材料搜集（代理机构）</font>------<font face=\"宋体\">法律文书撰写</font></span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">下达裁决（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人领取裁定并专业讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">什么是商标的无效宣告答辩？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>自商标注册成功之日起五年内（驰名商标所有人的维权期限</span><span>或对恶意注册人</span><span>不</span><span>受</span><span>五年</span><span>时间局限</span><span>），任何主体如发现该商标侵犯了其在先权利或者违反了《商标法》第十条、第十一条及第十二条的相关规定，均可向商标</span><span>局</span><span>对该商标提出无效宣告申请。商标</span><span>局</span><span><font face=\"宋体\">根据该申请启动商标无效宣告审理程序，将该申请材料副本及《无效宣告答辩通知书》一并下发至商标注册人（如商标注册经代理机构递交，则该卷宗下发至代理机构），限定商标注册人在收到相关通知</font>30<font face=\"宋体\">日内对该申请做出答辩意见，期满未答辩的，不影响无效宣告程序的进行。而商标注册人基于无效宣告申请人提起的申请在法定期限内以书面形式递交相关辩驳意见及证据材料的法律行为，即为商标的无效宣告答辩。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>对于注册商标在何种情况下可以提起无效宣告</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>该商标与自有品牌构成相同或者类似商品上的相同或者近似商标；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>该商标的注册对他人商标构成抢注；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>该商标的注册带有欺骗性，易使消费者对商品或者服务的产地、质量特点等产生混淆和误认；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>该商标侵犯了驰名商标注册人的合法权益；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>该商标为产品的通用名称；</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>该商标侵犯了他人的在先权利，如著作权、企业字号权等</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告答辩权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到无效宣告申请卷宗及《无效宣告答辩通知书》之日起</font>30<font face=\"宋体\">日内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告答辩的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>对方无效宣告申请卷宗的理由及证据材料均是针对该商标不应被核准注册而撰写和整理，其请求均为对该商标宣告无效，对商标注册人必然十分不利。如不进行答辩意见，则无法将对方的理由及证据以一种有效的途径进行辩驳，该标极易被商标</span><span>局</span><span>宣告无效。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告答辩的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标无效宣告答辩可由申请人自行向国家商标</span><span>局</span><span>提出，亦可委托专业商标代理机构代为提出，因该事务涉及法律专业撰写及证据材料搜集整理，专业性极强，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>5<font face=\"宋体\">、</font></span></b><b><span>商标无效宣告答辩的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>无效宣告答辩分两种法律后果：其一，该答辩意见通过商标</span><span>局</span><span>的审核，则商标继续维持注册；其二，该答辩意见未通过商标局的审核，则商标被宣告无效。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/de673ef359884f9b91169d4a8460f657', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '无', '无', 0, NULL, 'http://haozhiimage.haozhizixun.com/13注册商标无效宣告复审案.doc');
INSERT INTO `haozhi_yw` VALUES ('20030', '商标不予注册复审', 339900, 599900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">在先专业评估通过率（代理机构）</font>------<font face=\"宋体\">证据材料搜集（代理机构）</font><font face=\"Calibri\">------</font><font face=\"宋体\">法律文书撰写，上报审核（代理机构）</font><font face=\"Calibri\">------</font><font face=\"宋体\">审查，下达裁决（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人并专业讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>证据材料（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标不予注册复审的权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到《商标不予注册裁定书》之日起</font>15<font face=\"宋体\">日内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>不予注册复审的意义</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>由于不予注册复审由</span><span>商标局评审业务处</span><span>行驶审查权，而商标异议申请则由商标局</span><span>异议处</span><span>行使审查权，因此不予注册复审在审查</span><span>部门</span><span>及审查员的配备上与商标局完全不同；且不予注册复审的审核</span><span>标准和严谨程度皆在商标异议审查之上，考虑的各种主客观因素的范围也大大加宽</span><span>。因此对裁定不予注册的商标进行复审则可大大提升该标被核准通过的可能性，该复审申请也是最后一次致使该商标被核准注册的机会，建议企业积极行使法律赋予的该项权利。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>不予注册复审如未成功怎么办</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>如不予注册复审未能成功，则可继续启用司法救济途径，或者考虑将该商标变更方案重新申报注册。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>什么是商标不予注册复审</span></b><b><span>？</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标注册申请通过商标局的实质审查后，会对外公示三个月，即该商标进入异议公告期。在此期间内，任何</span><span>利害关系</span><span>主体可对该标提出异议申请，商标局依据异议人的申请开启异议审理程序。经过商标局的实质审查后，如相关异议理由被商标局支持，则会针对该商标下达《不予注册裁定书》。商标申请人如对该裁定不服，可在法律期限</span><span>内</span><span><font face=\"宋体\">提出复审，即</font>“不予注册复审”。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/5e399d73de4e418f853c1e68907707fb', '10089', '资深商标代理人负责撰写案件；代理人平均执业10年以上，负责案件平均过万。', '无', '无', 75000, NULL, 'http://haozhiimage.haozhizixun.com/14商标不予注册复审案.doc');
