INSERT INTO `haozhi_yw` VALUES ('20032', '商标撤销复审', 269900, 499900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>法律文书撰写</span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">通知对方进行答辩或质证意见（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">审查，下达裁决（商标</font></span><span>局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人并讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">什么是商标撤销三年不使用复审申请？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">根据《商标法》相关规定，注册商标存在无正当理由连续</font>3<font face=\"宋体\">年不使用情形的，任何单位或者个人均可向商标局申请撤销该注册商标，该申请即指对注册商标的撤销三年不使用申请。商标局基于该申请下达相关《撤销三年不使用裁定》，其中申请人或被申请人任何一方如不服商标局的裁决，均可提出复审，即“商标撤销三年不使用复审申请”。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span>商标撤销复审申请的权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到《撤销三年不使用裁定》之日起</font>15<font face=\"宋体\">日内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标撤销三年不使用复审申请的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>其一，对于商标注册人来讲，该复审申请是自有注册商标在行政程序中的最后一次权利救济，如商标注册人放弃复审或者递交的复审理由及证据材料未被商标</span><span>局</span><span>支持，则该商标必定予以撤销，且行政流程终结。即使后续仍有司法救济程序，但因注册人放弃该复审程序，则通过司法救济流程维持商标注册权属的可能性微乎其微；其二，对于原撤销三年不使用申请人来讲，继续该复审流程可对商标注册人的使用证据加以质证（在原撤销三年不使用流程中是不存在质证环节的，双方递交相关材料后商标局直接裁决）并提出质疑意见，且对于商标的撤销三年不使用申请来讲，</span><span>对</span><span>审核比</span><span>撤销申请</span><span>的审核更为严格，对使用证据的要求更为严谨，因此该复审流程可大大加强对该注册商标予以撤销的可能性。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标撤销复审申请的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标撤销复审申请可由申请人自行向国家商标</span><span>局</span><span>提出，亦可委托专业商标代理机构代为提出，因该申请涉及法律专业撰写，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标撤销复审申请的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>撤销复审申请针对该商标注册人（原撤销三年不使用被申请人）和原撤销三年不使用申请人分两种法律后果：其一，如该复审申请为商标注册人（原撤销三年不使用被申请人）提出，如该复审理由及证据材料被商标</span><span>局</span><span>认可，则该商标继续有效；如该复审理由及证据材料未被商标</span><span>局</span><span>认可，则该商标予以撤销。其二，如该复审申请为原撤销三年不使用申请人提出，如该复审理由被商标</span><span>局</span><span>认可，则该商标予以撤销；如该复审理由未被商标</span><span>局</span><span>认可，则该商标继续有效。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/b3694c78903947d1ab7638a5560cc94b', '10089', '资深金牌商标代理人负责撰写案件；执业15年以上，负责案件数万。', '无', '无', 75000, NULL, 'http://q55l2dpen.bkt.clouddn.com/1232201997726388224.doc');
INSERT INTO `haozhi_yw` VALUES ('20033', '商标撤销复审答辩', 269900, 499900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>律文书撰写</span><span>后申请人盖章回传（代理机构、代理人）</span><span>------</span><span>制作案卷并</span><span><font face=\"宋体\">上报审核（代理机构）</font>------<font face=\"宋体\">审查，下达裁决（</font></span><span>商标局</span><span><font face=\"宋体\">）</font>------<font face=\"宋体\">通知申请人并专业讲解裁决内容（代理机构）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>营业执照副本复印件（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、</font></span><span>代理协议及委托书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>法律申报文书（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>4<font face=\"宋体\">、</font></span><span>详细法律理由（代理机构准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>5<font face=\"宋体\">、</font></span><span>证据材料收集整理（代理机构辅助申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、</font></span></b><b><span><font face=\"宋体\">商标撤销复审答辩（或</font>“证据交换”）的权利期限</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">自收到《答辩通知书》或者《证据交换通知书》之日起</font>30<font face=\"宋体\">日内。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、</font></span></b><b><span>商标撤销三年不使用复审答辩（或证据交换）的重要性</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>其一，对于商标注册人来讲，该复审答辩是自有注册商标在行政流程中的最后一次权利救济，如商标注册人放弃答辩或者递交的答辩理由及证据材料未被商标</span><span>局</span><span><font face=\"宋体\">支持，则该商标必定予以撤销，且该裁决为终结裁决。即使后续仍有司法救济程序，但因注册人放弃该程序，则通过司法救济流程维持商标注册权属的可能性微乎其微；其二，对于原撤销三年不使用申请人来讲，继续该</font>“证据交换”流程可对商标注册人的使用证据加以质证（在原撤销三年不使用流程中是不存在质证环节的，双方递交相关材料后商标局直接裁决）并提出质疑意见，且对于商标的撤销三年不使用复审申请来讲，</span><span>其审核比撤销上不使用的审核</span><span>更为严格，对使用证据的要求更为严谨，因此该质证流程可大大加强对该注册商标予以撤销的可能性。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>3<font face=\"宋体\">、</font></span></b><b><span>商标撤销复审答辩的提起方式</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>商标撤销复审答辩可由答辩人自行向国家商标</span><span>局</span><span>提出，亦可委托专业商标代理机构代为提出，因该申请涉及法律专业撰写及证据材料的搜集整理，因此一般情况下均由代理机构代为提起。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>4<font face=\"宋体\">、</font></span></b><b><span>商标撤销复审答辩（证据交换）的法律后果</span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">撤销复审答辩针对该商标注册人（原撤销三年不使用被申请人）和原撤销三年不使用申请人（称</font>“证据交换”）分两种法律后果：其一，如该复审答辩为商标注册人（原撤销三年不使用被申请人）做出，该复审理由及证据材料如被商标</span><span>局</span><span>认可，则该商标继续有效；该复审理由及证据材料未被商标</span><span>局</span><span>认可，则该商标予以撤销。其二，如该证据交换为原撤销三年不使用申请人做出，该质证理由被商标</span><span>局</span><span>认可，则该商标予以撤销；该质证理由未被商标</span><span>局</span><span>认可，则该商标继续有效。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">什么是商标撤销三年不使用复审答辩？</font>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">根据《商标法》相关规定，注册商标存在无正当理由连续</font>3<font face=\"宋体\">年不使用情形的，任何单位或者个人均可向商标局申请撤销该注册商标，该申请即指对注册商标的撤销三年不使用申请。商标局基于该申请下达相关《撤销三年不使用裁定》，其中申请人或被申请人任何一方如不服商标局的裁决，均可提出复审，即商标撤销三年不使用复审申请。而商标注册人基于对方提起的复审申请在法定期限内以书面形式递交相关辩驳意见及证据材料的法律行为，即商标的撤销三年不使用复审答辩</font><font face=\"Calibri\">(</font><font face=\"宋体\">原撤销三年不使用申请人基于对方提起的复审申请在法定期限内以书面形式递交相关辩驳意见的法律行为，称为“撤销三年不使用复审证据交换”</font><font face=\"Calibri\">)</font><font face=\"宋体\">。</font></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/e51ffd7c649940898fb8fdb34fdbafcb', '10089', '资深金牌商标代理人负责撰写案件；执业15年以上，负责案件数万。', '无', '无', 0, '', 'http://haozhiimage.haozhizixun.com/17撤销注册商标复审答辩  增加.doc');
INSERT INTO `haozhi_yw` VALUES ('20034', '3-4个月', 19900, 39900, '<div id=\"content-container\" class=\"content-container clearfix\" data-showlog=\"tid:126;cst:1;logInfo:landing;\" data-extralog=\"flow:2;st:news;rid:9934027693638279266;pos:0;extra:;source:1;isBaijiahao:1;login:1;appId:1536766145586974;\" data-ratio=\"1\" data-rid=\"page\"><div id=\"left-container\" class=\"left-container\"><div class=\"item-wrap\"><div class=\"article \" id=\"article\" data-islow-browser=\"0\"><div class=\"article-content\"><p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（</font></span><span>版权局</span><span><font face=\"宋体\">）</font>----</span><span>制证下证</span><span>（</span><span>版权局</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>按照所选业务周期如期下证（以版权局收到文件日期为起始日期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>1、</span><!--[endif]--><span>公司营业执照</span><span>复印件并盖章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>2、</span><!--[endif]--><span>软件操作说明书及部分源代码（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>个人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>身份证复印件</span><span>并签字</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、软件操作说明书及部分源代码（申请人准备）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、软著保护的期限为多久</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">法人或者其他组织的软件著作权，保护期为</font>50<font face=\"宋体\">年，截止于软件首次发表后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日，但软件自开发完成之日起</font><font face=\"Calibri\">50</font><font face=\"宋体\">年内未发表的，不再保护。自然人的软件著作权，保护期为自然人终生及其死亡后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年，截止于自然人死亡后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日；软件是合作开发的，截止于最后死亡的自然人死亡后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、软著申请如何加快速度</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">普通软著登记需要</font>3<font face=\"宋体\">个月左右的周期</font></span><span>，</span><span>但为了满足不同周期的需求，</span><span>版权局开放加急的服务，</span><span>根据加急的周期收取加急服务费，时间越短加急费</span><span>价格越高</span><span>。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">办理软著登记的意义</font> </span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、高企申报、双软认定、游戏上线</font></span><span>的必备条件</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>根据《国家高新技术产业开发区外高新技术企业认定条件和办法》规定，企业软件著作权</span><span>是企业创新成果的证明文件</span><span>。</span><span>在企业</span><span>双软认证</span><span>中，</span><span>软件产品认定也要求软著必须登记</span><span>。</span><span>另外，一款游戏上架运营的前提条件之一也是必须拥有</span><span>该软件的</span><span>著作权。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、明确作品归属，打击盗版防止抄袭保护软件源代码，维权有据，不再受抄袭侵权的困扰。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>当</span><span>软件版权</span><span>所有人被</span><span>侵权时，</span><span>已办理</span><span>软件著作权登记证书</span><span>的，</span><span>司法机关可直接</span><span>将软著证书</span><span>作为证据使用；此外也是国家著作权管理机关惩处侵犯软件版权行为的执法依据。</span><span><o:p></o:p></span></p></div></div></div></div><div id=\"right-container\" class=\"right-container\"><div class=\"item-wrap\"><div class=\"related-news\"><div class=\"news-content \"><ul><li data-showlog=\"tid:136;cst:1;logInfo:related_news;\" data-extralog=\"flow:2;rid:;pos:4;extra:;isBaiJiaHao:1;login:1;\" data-rid=\"related_news_4\"><div class=\"item-content clearfix\"></div></li></ul></div></div><div id=\"relateAd\" ad-id=\"relate-js\" class=\"wangmeng-ad\" data-showlog=\"tid:369;cst:1;logInfo:adsjs;\" data-clklog=\"tid:370;cst:2;logInfo:adsjs;\" data-extralog=\"rid:;pos:5;extra:;baijiahao:1;login:1;\"></div></div></div></div>', 'http://q55l2dpen.bkt.clouddn.com/897b295f17824e1db7784927634b4589', '10090', '24小时快速响应；版权局24小时快速申报；百分百通过率。', '1600', '500', 0, '1', '');
