INSERT INTO `haozhi_yw` VALUES ('20038', '文字（汇编）作品', 29900, 59900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>业务下单并付款（代理人）</span><span>----</span><span>平台与代理人沟通并采集信息</span><span><font face=\"宋体\">（代理机构）</font>----</span><span>平台制作申报文件并发送代理人邮箱（代理机构）</span><span>----</span><span>资料盖章、扫描并回传（代理人）</span><span>----</span><span>平台提交版权局（代理机构）</span><span>----<font face=\"宋体\">审查（</font></span><span>版权局</span><span><font face=\"宋体\">）</font>----</span><span>制证下证</span><span>（</span><span>版权局</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>31-40<font face=\"宋体\">个工作日（起算日以版权局收到文件日期为准）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>1、</span><!--[endif]--><span>公司营业执照</span><span>复印件并盖章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>2、</span><!--[endif]--><span>版权登记申请书（文件由平台发送至邮箱后盖章回传）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>3、</span><!--[endif]--><span>作品样本（申请人准备电子版本）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>4、</span><!--[endif]--><span>作品说明书（申请人准备电子版本）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>5、</span><!--[endif]--><span>签署的权属声明（文件由平台发送至邮箱后盖章回传）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>6、</span><!--[endif]--><sp