</font>50<font face=\"宋体\">年。未发表，创作完成</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">4</font></span><span>）</span><span><font face=\"宋体\">、作者身份不明的作品保护期为</font>50<font face=\"宋体\">年</font><font face=\"Calibri\">(</font><font face=\"宋体\">自首次发表</font><font face=\"Calibri\">)</font><font face=\"宋体\">，但作者身份一经确定则适用一般规定。</font><font face=\"Calibri\">5</font></span><span>）</span><span><font face=\"宋体\">、出版者的版式设计权的保护期自首次出版后</font>10<font face=\"宋体\">年。</font><font face=\"Calibri\">6</font></span><span>）</span><span><font face=\"宋体\">、表演者享有的表明身分</font>;<font face=\"宋体\">保护表演形象不受歪曲等保护期不受限制</font><font face=\"Calibri\">;</font><font face=\"宋体\">其他自该表演发生后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">7</font></span><span>）</span><span><font face=\"宋体\">、录音录像制作者许可他人复制、发行、出租、通过信息网络向公众传播其录音录像制品的权利的保护期自首次制作完成后</font>50<font face=\"宋体\">年。</font><font face=\"Calibri\">8</font></span><span>）</span><span><font face=\"宋体\">、广播电台、电视台享有转播、录制、复制自首次播出后</font>50<font face=\"宋体\">年。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、作品版权的保护范围</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">）、文字作品：文字作品是指以语言文字的形式，或其他相当于语言文字的符号来表达作者感情、思想的作品。</font><font face=\"Calibri\">2</font><font face=\"宋体\">）、口述作品：口述作品是指以口头语言创作的、未以任何物质载体固定的作品，如演说、授课、法庭辩论、祝词、布道等。</font><font face=\"Calibri\">3</font><font face=\"宋体\">）、音乐、戏剧、曲艺、舞蹈、杂技艺术作品。</font><font face=\"Calibri\">4</font><font face=\"宋体\">）、音乐作品：音乐作品</font><font face=\"Calibri\">,</font><font face=\"宋体\">这是指能够演唱或演奏以旋律节奏、合声进行组合，以乐谱或歌词表达作者思想的作品，如民歌、通俗歌曲、流行歌曲、交响曲、弦乐曲、爵士乐、吹打乐等。</font><font face=\"Calibri\">5</font><font face=\"宋体\">）、戏剧、曲艺作品：戏剧作品不是指一台演出的完整的戏，而是指演出这台戏的剧本。</font></span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/06cc979cd28b4cb691a886d77d574fb7', '10091', '本产品申报内容指文字、口述、汇编作品版权登记；最快31个工作日下证。', '498', '无', 30000, NULL, '');
