face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">4</font></span><span>）</span><span><font face=\"宋体\">、作者身份不明的作品保护期为</font>50<font face=\"宋体\">年</font><font face=\"Calibri\">(</font><font face=\"宋体\">自首次发表</font><font face=\"Calibri\">)</font><font face=\"宋体\">，但作者身份一经确定则适用一般规定。</font><font face=\"Calibri\">5</font></span><span>）</span><span><font face=\"宋体\">、出版者的版式设计权的保护期自首次出版后</font>10<font face=\"宋体\">年。</font><font face=\"Calibri\">6</font></span><span>）</span><span><font face=\"宋体\">、表演者享有的表明身分</font>;<font face=\"宋体\">保护表演形象不受歪曲等保护期不受限制</font><font face=\"Calibri\">;</font><font face=\"宋体\">其他自该表演发生后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">7</font></span><span>）</span><span><font face=\"宋体\">、录音录像制作者许可他人复制、发行、出租、通过信息网络向公众传播其录音录像制品的权利的保护期自首次制作完成后</font>50<font face=\"宋体\">年。</font><font face=\"Calibri\">8</font></span><span>）</span><span><font face=\"宋体\">、广播电台、电视台享有转播、录制、复制自首次播出后</font>50<font face=\"宋体\">年。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、作品版权的保护范围</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">）、文字作品：文字作品是指以语言文字的形式，或其他相当于语言文字的符号来表达作者感情、思想的作品。</font><font face=\"Calibri\">2</font><font face=\"宋体\">）、口述作品：口述作品是指以口头语言创作的、未以任何物质载体固定的作品，如演说、授课、法庭辩论、祝词、布道等。</font><font face=\"Calibri\">3</font><font face=\"宋体\">）、音乐、戏剧、曲艺、舞蹈、杂技艺术作品。</font><font face=\"Calibri\">4</font><font face=\"宋体\">）、音乐作品：音乐作品</font><font face=\"Calibri\">,</font><font face=\"宋体\">这是指能够演唱或演奏以旋律节奏、合声进行组合，以乐谱或歌词表达作者思想的作品，如民歌、通俗歌曲、流行歌曲、交响曲、弦乐曲、爵士乐、吹打乐等。</font><font face=\"Calibri\">5</font><font face=\"宋体\">）、戏剧、曲艺作品：戏剧作品不是指一台演出的完整的戏，而是指演出这台戏的剧本。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、美术版权保护的期限为多久</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">根据著作权法等相关法律的规定，著作权的保护期如下：</font>1</span><span>）</span><span><font face=\"宋体\">、作者为公民，其保护期为作者有生之年加死亡后</font>50<font face=\"宋体\">年。合作作品的保护期为作者终生加死亡后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年，从最后死亡的作者的死亡时间起算。</font><font face=\"Calibri\">2</font></span><span>）</span><span><font face=\"宋体\">、法人作品，保护期自作品首次发表后</font>50<font face=\"宋体\">年。未发表，创作完成</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">3</font></span><span>）</span><span><font face=\"宋体\">、电影作品和以类似摄制电影的方法创作的作品、摄影作品，保护期自作品首次发表后</font>50<font face=\"宋体\">年。未发表，创作完成</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">4</font></span><span>）</span><span><font face=\"宋体\">、作者身份不明的作品保护期为</font>50<font face=\"宋体\">年</font><font face=\"Calibri\">(</font><font face=\"宋体\">自首次发表</font><font face=\"Calibri\">)</font><font face=\"宋体\">，但作者身份一经确定则适用一般规定。</font><font face=\"Calibri\">5</font></span><span>）</span><span><font face=\"宋体\">、出版者的版式设计权的保护期自首次出版后</font>10<font face=\"宋体\">年。</font><font face=\"Calibri\">6</font></span><span>）</span><span><font face=\"宋体\">、表演者享有的表明身分</font>;<font face=\"宋体\">保护表演形象不受歪曲等保护期不受限制</font><font face=\"Calibri\">;</font><font face=\"宋体\">其他自该表演发生后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年。</font><font face=\"Calibri\">7</font></span><span>）</span><span><font face=\"宋体\">、录音录像制作者许可他人复制、发行、出租、通过信息网络向公众传播其录音录像制品的权利的保护期自首次制作完成后</font>50<font face=\"宋体\">年。</font><font face=\"Calibri\">8</font></span><span>）</span><span><font face=\"宋体\">、广播电台、电视台享有转播、录制、复制自首次播出后</font>50<font face=\"宋体\">年。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、美术版权的保护范围</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">）、</font></span><span>美术、建筑作品：美术作品，是指绘画、书法、雕塑等以线条、色彩或其他方式构成的有审美意义的平面或其他方式构成的平面或者立体的造型艺术作品。</span><span>2<font face=\"宋体\">）、</font></span><span>摄影作品：摄影作品，是指借助于摄影器材，通过合理利用光学、化学原理，将客观物体形象再现于感光材料上的一种艺术作品。</span><span>3<font face=\"宋体\">）、</font></span><span>电影作品和以类似摄制电影的方法创作的作品：电影作品和以类似摄制电影的方法创作的作品是指摄制在一定记录介质上，由一系列的伴音或无伴音的画面组成，并借助于适当的装置放映、播放的作品。</span><span>4<font face=\"宋体\">）、</font></span><span>工程设计、产品设计图纸、地图、示意图等图形作品和模型作品：图形作品，是指为施工、生产绘制的工程设计图、产品设计图，以及反映地理现象、说明事物原理或者结构的地图、示意图等作品。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/82d0d67552c24458a6e5c93779f11937', '10091', '本产品包含文字作品/美术作品著作权转让，不分类型价格不变；最快31个工作日下证。', '498', '无', 30000, NULL, '');
INSERT INTO `haozhi_yw` VALUES ('20041', '16-20工作日', 29900, 49900, '<p class=\"MsoNormal\"><b><span>流程与周期</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>流程：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">材料准备及上报（代理机构）</font>----<font face=\"宋体\">审查（</font></span><span>版权局</span><span><font face=\"宋体\">）</font>----</span><span>制证下证</span><span>（</span><span>版权局</span><span>）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>周期：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>按照所选业务周期如期下证（以版权局收到文件日期为起始日期）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>&nbsp;</span></p><p class=\"MsoNormal\"><b><span>所需材料</span></b><b><span>&nbsp;</span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>法人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>1、</span><!--[endif]--><span>公司营业执照</span><span>复印件并盖章</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span>2、</span><!--[endif]--><span>软件操作说明书及部分源代码（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>个人申请：</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、</font></span><span>身份证复印件</span><span>并签字</span><span>（申请人准备）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、软件操作说明书及部分源代码（申请人准备）</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>3<font face=\"宋体\">、</font></span><span>代理委托书（系统下载后签章）</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span>常见问题</span></b><b><span>&nbsp;Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span>1<font face=\"宋体\">、软著保护的期限为多久</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">法人或者其他组织的软件著作权，保护期为</font>50<font face=\"宋体\">年，截止于软件首次发表后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日，但软件自开发完成之日起</font><font face=\"Calibri\">50</font><font face=\"宋体\">年内未发表的，不再保护。自然人的软件著作权，保护期为自然人终生及其死亡后</font><font face=\"Calibri\">50</font><font face=\"宋体\">年，截止于自然人死亡后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日；软件是合作开发的，截止于最后死亡的自然人死亡后第</font><font face=\"Calibri\">50</font><font face=\"宋体\">年的</font><font face=\"Calibri\">12</font><font face=\"宋体\">月</font><font face=\"Calibri\">31</font><font face=\"宋体\">日。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>2<font face=\"宋体\">、软著申请如何加快速度</font></span></b><b><span>？</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span><font face=\"宋体\">普通软著登记需要</font>3<font face=\"宋体\">个月左右的周期</font></span><span>，</span><span>但为了满足不同周期的需求，</span><span>版权局开放加急的服务，</span><span>根据加急的周期收取加急服务费，时间越短加急费</span><span>价格越高</span><span>。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><b><span>&nbsp;</span></b></p><p class=\"MsoNormal\"><b><span><font face=\"宋体\">办理软著登记的意义</font> </span></b><b><span>Service Introduction</span></b><b><span><o:p></o:p></span></b></p><p class=\"MsoNormal\"><span>1<font face=\"宋体\">、高企申报、双软认定、游戏上线</font></span><span>的必备条件</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>根据《国家高新技术产业开发区外高新技术企业认定条件和办法》规定，企业软件著作权</span><span>是企业创新成果的证明文件</span><span>。</span><span>在企业</span><span>双软认证</span><span>中，</span><span>软件产品认定也要求软著必须登记</span><span>。</span><span>另外，一款游戏上架运营的前提条件之一也是必须拥有</span><span>该软件的</span><span>著作权。</span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>2<font face=\"宋体\">、明确作品归属，打击盗版防止抄袭保护软件源代码，维权有据，不再受抄袭侵权的困扰。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>当</span><span>软件版权</span><span>所有人被</span><span>侵权时，</span><span>已办理</span><span>软件著作权登记证书</span><span>的，</span><span>司法机关可直接</span><span>将软著证书</span><span>作为证据使用；此外也是国家著作权管理机关惩处侵犯软件版权行为的执法依据。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/1ed8abaf7add4c49b86c5ca55733be36', '10090', '提间利需向就金用被广即商中平。等白太周议却亲成单气属白由层市。农专毛本品放或我元对种果又力号图。', '1600', '1499', 85000, '1', '');
