权有据，不再受抄袭侵权的困扰。</font></span><span><o:p></o:p></span></p><p class=\"MsoNormal\"><span>当</span><span>软件版权</span><span>所有人被</span><span>侵权时，</span><span>已办理</span><span>软件著作权登记证书</span><span>的，</span><span>司法机关可直接</span><span>将软著证书</span><span>作为证据使用；此外也是国家著作权管理机关惩处侵犯软件版权行为的执法依据。</span><span><o:p></o:p></span></p>', 'http://q55l2dpen.bkt.clouddn.com/8bf59d4ca1e942e3883012eab949f083', '10090', '提间利需向就金用被广即商中平。等白太周议却亲成单气属白由层市。农专毛本品放或我元对种果又力号图。', '3300', '无', 123000, '2', '');
